('2ea6edbe-f86c-4677-bba4-0026f2beda69', '267b2296-76e7-44f9-be6e-870471624d9d', 'content', 'PDO là API cung cấp cho chúng ta để kết nối cũng như thao tác với CSDL, chuyển dữ liệu thành các đối tượng để chúng ta dễ thao tác. Hiện tai PDO hỗ trợ khoảng 12 loại hệ quản trị CSDL khác nhau, không giống như mysqli chỉ hỗ trợ MySQL. PDO ra đời đã làm cho PHP đã mạnh lại càng trở nên mạnh mẽ hơn.\n\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', 'PDO là API cung cấp cho chúng ta để kết nối cũng như thao tác với CSDL, chuyển dữ liệu thành các đối tượng để chúng ta dễ thao tác. Hiện tai PDO hỗ trợ khoảng 12 loại hệ quản trị CSDL khác nhau, không giống như mysqli chỉ hỗ trợ MySQL. PDO ra đời đã làm cho PHP đã mạnh lại càng trở nên mạnh mẽ hơn.'),
