('70f3dbde-8490-42a4-a13a-9c102d79dce1', '5cc00efd-4dd7-4be0-bf67-e956846d0b76', 'content', 'Việc dùng mặc định đường dẫn khi bạn cài đặt Wordpress trên XAMP không có vấn đề gì cả, nhưng nhìn nó không chuyên nghiệp cũng như không giống thực tế của một domain do đó trong video này tôi sẽ hướng dẫn bạn thây đổi domain cho nó.', 'Việc dùng mặc định đường dẫn khi bạn cài đặt Wordpress trên XAMP không có vấn đề gì cả, nhưng nhìn nó không chuyên nghiệp cũng như không giống thực tế của một domain do đó trong video này tôi sẽ hướng dẫn bạn thây đổi domain cho nó.\r\n\r\nBạn có thể copy đoạn code dưới đây để dán vào http.conf\r\n\r\n```\r\n<VirtualHost *:80>\r\n   DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```'),
