('72cdbcfe-4394-4f0a-95fb-de2a4fad71dc', 'b526f8dd-42dc-4dce-91e2-8c97bd328c98', 'content', 'Category nghĩa là một nhóm bao quát chứa các bài viết trong blog. Nó giống như những cái cặp giấy và các tờ giấy là những bài viết được chứa ở trong đó. Category có thể được phân cấp, tức là một Category có thể bao gồm nhiều Category nhỏ khác ở trong.\n\nTag nghĩa là một phép phân loại đặc biệt của bài viết để mô tả cụ thể các chủ đề liên quan. Nếu ta xem Category là cặp sách, bài viết là giấy thì Tag cũng được xem là những cái kẹp giấy để kẹp một số bài viết có liên quan lại với nhau.', 'Category nghĩa là một nhóm bao quát chứa các bài viết trong blog. Nó giống như những cái cặp giấy và các tờ giấy là những bài viết được chứa ở trong đó. Category có thể được phân cấp, tức là một Category có thể bao gồm nhiều Category nhỏ khác ở trong.\r\n\r\nTag nghĩa là một phép phân loại đặc biệt của bài viết để mô tả cụ thể các chủ đề liên quan. Nếu ta xem Category là cặp sách, bài viết là giấy thì Tag cũng được xem là những cái kẹp giấy để kẹp một số bài viết có liên quan lại với nhau.'),
