('beb2b829-eade-41d3-8a94-d453098a00b4', '00bd7c03-797d-4302-a9ed-19aec288c793', 'content', 'Khi bạn tìm kiếm trên Goole từ khoá như học lập trình web, hay cài đặt WordPress bạn sẽ thấy có một cụm từ là Mysql, vậy nó là gì trong bài viết này tôi sẽ giải thích Mysql là gì tại sao nó là cần thiết\n\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', 'Khi bạn tìm kiếm trên Goole từ khoá như học lập trình web, hay cài đặt WordPress bạn sẽ thấy có một cụm từ là Mysql, vậy nó là gì trong bài viết này tôi sẽ giải thích Mysql là gì tại sao nó là cần thiết.'),
