('c01418f6-9566-49c9-b4d6-42e2be9b011c', '0be8986c-ceb7-4679-a71d-1596c68e26a2', 'content', 'Trong bài học này tôi sẽ hướng dẫn các bạn cách tạo ssh-key trên window, sau đó thêm ssh-key này vào config trên github để mỗi lần bạn commit(đưa) code lên Github không yêu cầu mật khẩu nữa.\n\nTôi sẽ demo video này trên hai nền tảng đó là Window và MacOS. Bạn có thể xem nhiều video nữa trên https://gsviec.com', 'Trong bài học này tôi sẽ hướng dẫn các bạn cách tạo ssh-key trên window, sau đó thêm ssh-key này vào config trên github để mỗi lần bạn commit(đưa) code lên Github không yêu cầu mật khẩu nữa.\r\n\r\nTôi sẽ demo video này trên hai nền tảng đó là Window và MacOS. Bạn có thể xem nhiều video nữa trên https://gsviec.com'),
