('e4df5e41-c4bf-4ef5-b4f1-c0b678ef8134', 'af3bf4b7-9ee7-438c-832c-e797671c1bbc', 'content', 'Virtual Host là một cấu hình trong Apache để cho phép nhiều domain cùng chạy trên một máy chủ. Có một khái niệm khác được đề cập tới trong Nginx cũng có chức năng tương tự như Virtual Host được gọi là Server Block. Trong Log này mình chỉ muốn chia sẻ với các bạn còn lạ lẫm về Vhost cách để cấu hình một Virtual Host trong Windows, ở đây mình sử dụng XAMPP làm môi trường pháp triển.\n\n\nTôi sẽ demo video này trên hai nền tảng đó là Window. Bạn có thể xem nhiều video nữa trên https://gsviec.com', 'Virtual Host là một cấu hình trong Apache để cho phép nhiều domain cùng chạy trên một máy chủ. Có một khái niệm khác được đề cập tới trong Nginx cũng có chức năng tương tự như Virtual Host được gọi là Server Block. Trong Log này mình chỉ muốn chia sẻ với các bạn còn lạ lẫm về Vhost cách để cấu hình một Virtual Host trong Windows, ở đây mình sử dụng XAMPP làm môi trường pháp triển.\r\n\r\n```\r\n<VirtualHost *:80>\r\n  DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```\r\nTôi sẽ demo video này trên hai nền tảng đó là Window. Bạn có thể xem nhiều video nữa trên https://gsviec.com'),
