('f073b7c4-19c2-41a7-b09c-21ad7e187cf8', '08273bfe-e500-4414-889b-254b100935ed', 'content', 'XAMPP là môi trường phát triển web trên hệ điều hành Windows, Linux, Mac OS, Solaris. Nó cho phép bạn tạo các ứng dụng web với Apache2, PHP, Perl và MySQL. Bên cạnh đó, PhpMyAdmin cho phép quản lý cơ sở dữ liệu dễ dàng.\n\nNhưng bạn thường dùng XAMP cho Window thôi, chứ ít có ai dùng nó cho Linux:) ngoài ra XAMPP là viết tắt của các từ: Apache, MySQL, PHP và Perl.\n\n\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', 'XAMPP là môi trường phát triển web trên hệ điều hành Windows, Linux, Mac OS, Solaris. Nó cho phép bạn tạo các ứng dụng web với Apache2, PHP, Perl và MySQL. Bên cạnh đó, PhpMyAdmin cho phép quản lý cơ sở dữ liệu dễ dàng.\r\n\r\nNhưng bạn thường dùng XAMP cho Window thôi, chứ ít có ai dùng nó cho Linux:) ngoài ra XAMPP là viết tắt của các từ: Apache, MySQL, PHP và Perl.\r\n\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com'),
