INSERT INTO `playlist` (`id`, `usersId`, `title`, `slug`, `content`, `imageFilename`, `createdAt`, `status`) VALUES
(1, 16, 'Git và GitHub Căn Bản', 'git-va-github-can-ban', 'Trong serie này, bạn sẽ được làm quen với hệ thống Git và cách sử dụng nó. Bạn sẽ hiểu được các khái niệm và thuật ngữ trong Git như Clone, Branch, Stage, Commit, Tracking, Merge, Pull, Push\n\nĐồng thời bạn sẽ làm quen với Github và cách dùng nó cho các dự án của bạn chúng tôi huy vọng các bạn sẽ thấy hữu ích khi học khoá học này. Thanks', 'git-and-github-basic.png', 1489917528, 'active'),
(2, 16, 'Khoá học PHP căn bản', 'khoa-hoc-php-can-ban', 'Nhận thấy có nhiều bạn trẻ muốn học PHP để phát triển web nhưng chưa có kiến thức căn bản về nó, vì vậy tôi quyết định mở khoá học Lập trình PHP \r\n\r\nKhoá học php căn bản dành cho các bạn mới tìm hiểu về PHP, chương trình đào tạo từ những cái cơ bản nhất đến chuyên sâu. Sau khi kết thúc khóa học căn bản bạn có thể viết được một website cơ bản.\r\n\r\nToàn bộ mã nguồn code các bạn có thể xem trên GITHUB https://github.com/gsviec/phpbegin', 'php-basic.png', 1490075550, 'active'),
(3, 16, 'Khoá học Phalcon 101', 'khoa-hoc-phalcon-can-ban', 'Trong hơn 3 năm qua tôi đã nghiên cứu và làm việc trên Phalcon Framework để xây dựng ứng dụng online theo yêu cầu của khách hàng. Trong quá trình xây  và phát triển dựng dự án cho khách hàng,  chúng tôi đã nhận thấy những ưu điểm vượt trội của Phalcon framework  so với các PHP framework\r\n\r\nVì vậy tôi quyết định mở khóa học Phalcon này để chia sẽ những hiểu biết của tôi cho các bạn trẻ muốn học Phalcon. Toàn bộ mã nguôn khóa học bạn có thể xem https://github.com/gsviec/phalcon-canban ', 'phalcon.png', 1490075550, 'active'),
(4, 16, 'Khóa Học WordPress Căn Bản', 'khoa-hoc-wordpress-can-ban', 'Trong serie bài học này, bạn sẽ bắt đầu từ những kiến thức cơ bản nhất cực kỳ cần thiết đối với tất cả những người có mong muốn tự làm và quản trị được một website bằng WordPress.\r\n\r\nBạn sẽ tự làm được ít nhất một website hoàn chỉnh. Sau này không cần thuê ai nữa, thích web nào là làm web đó. Thiết kế web không khó như bạn tưởng. Học MỘT lần, dùng CẢ ĐỜI!', 'wordpress001.jpg', 1490414092, 'active'),
(5, 16, 'Khóa Học Magento 2 Căn Bản', 'khoa-hoc-magento-2-can-ban', 'Trong serie bài học này, bạn sẽ bắt đầu từ những kiến thức cơ bản nhất cực kỳ cần thiết đối với tất cả những người có mong muốn tự làm và quản trị được một website bán hàng online\r\n\r\nBạn sẽ tự làm được ít nhất một website hoàn chỉnh. Sau này không cần thuê ai nữa, thích web nào là làm web đó. Thiết kế web không khó như bạn tưởng. Học MỘT lần, dùng CẢ ĐỜI!', 'magento.png', 1490414092, 'active'),
(6, 16, 'Khóa Học Amazon Web Service căn bản', 'khoa-hoc-amazon-web-service-can-ban', 'Trong serie khóa học này, bạn sẽ có các khái niệm căn bản về S3, EC2, Cách tính chi phí dịch vụ AWS cũng như các khái niệm căn bản về nó.\n\nNgoài ra cuối khóa học tôi sẽ hướng dẫn bạn cách sữ dụng S3 để chứa hình ảnh hoặc Video và sử dụng CloudFront làm CDN cho website của bạn mà cụ thể là Wordpress\n\nCuối cùng là phần nâng cao cung cấp các dòng lệnh để xử lý AWS cũng như scale website với ELB và nhiều hơn thế nữa\n', 'aws.jpg', 1490414092, 'active'),
(7, 16, 'Khóa Học Docker căn bản', 'khoa-hoc-docker-can-ban', 'Trong serie bài học này, bạn sẽ có các khái niệm căn bản về Docker, cách dùng nó vào các dự án thực tế như Wordpress, Phalcon và Magento\r\n\r\n\r\nBạn sẽ hiểu được cách sử dụng Docker Compose, cách tạo tự dộng một image Docker\r\nToàn bộ mã nguồn demo bạn có thể tải qua đường dẫn này [https://github.com/gsviec/docker-canban](https://github.com/gsviec/docker-canban)', 'docker.png', 1490414099, 'active'),
(8, 16, 'Khoá học Phalcon 102', 'khoa-hoc-phalcon-102', 'Trong khóa học Phalcon trước tôi đã hướng dẫn các bạn hiểu các khái niệm căn bản về cấu trúc cũng như cách hoạt động Phalcon PHP. Vì vậy trong khóa hoc này tôi sẽ tập trung hướng dẫn bạn xử lý phần models và form trong Phalcon\r\n\r\nToàn bộ mã nguôn khóa học bạn có thể xem https://github.com/gsviec/phalcon-canban ', 'phalcon.png', 1494323442, 'active'),
(9, 16, 'Khoá học VPS căn bản', 'khoa-hoc-vps-can-ban', 'Khóa học Cài đặt và Quản trị Linux Server cung cấp cho học viên các kiến thức và kỹ năng quan trọng nhất để có thể làm chủ các tiến trình Cài đặt và Quản trị một Linux Server và các dịch vụ mạng kèm theo.\r\n\r\nToàn bộ mã nguôn khóa học bạn có thể xem https://github.com/gsviec/linux-canban ', 'vps-basic.png', 1494323442, 'active'),
(10, 16, 'Khóa Học Amazon Web Service căn bản 002', 'khoa-hoc-amazon-web-service-can-ban-002', 'Trong serie khóa học này, bạn sẽ có các khái niệm căn bản về S3, EC2, Cách tính chi phí dịch vụ AWS cũng như các khái niệm căn bản về nó.\r\n\r\nNgoài ra cuối khóa học tôi sẽ hướng dẫn bạn cách sữ dụng S3 để chứa hình ảnh hoặc Video và sử dụng CloudFront làm CDN cho website của bạn mà cụ thể là Wordpress\r\n\r\nCuối cùng là phần nâng cao cung cấp các dòng lệnh để xử lý AWS cũng như scale website với ELB và nhiều hơn thế nữa\r\n', 'aws.jpg', 1490414092, 'active');
INSERT INTO `posts` (`id`, `usersId`, `type`, `techOrder`, `title`, `link`, `slug`, `content`, `excerpt`, `thumbnail`, `filename`, `videoFilename`, `duration`, `categoryId`, `tags`, `numberViews`, `numberReply`, `createdAt`, `modifiedAt`, `editedAt`, `status`, `locked`, `deleted`, `acceptedAnswer`, `monetize`, `sticked`) VALUES
(1, 16, 'video', 'youtube', 'Giới thiệu biến trong PHP', NULL, 'gioi-thieu-bien-trong-php', 'Cú pháp PHP là giống như các ngôn ngữ C, JavaScript nó là tập hợp của các ký tự dòng lệnh hoặc biểu thức, nếu bạn có học qua thì tốt không học thì cũng chả sao:', NULL, 'https://i.ytimg.com/vi/q-A3QFcUvKk/mqdefault.jpg', NULL, 'q-A3QFcUvKk', '0:3:59', 1, 'php,gsviec,php-can-ban', 341, 0, 1489717284, 1490757906, 1490757906, 'active', 'N', 0, 'N', 'N', 'N'),
(3, 16, 'video', 'youtube', 'Nhúng code PHP vào trong HTML', NULL, 'nhng-code-php-vo-trong-html', 'Trong video này tôi sẽ hướng dẫn các bạn nhúng mã code PHP vào trong HTML\r\n\r\nĐể xem nhiều video bạn có thể vào trang https://gsviec.com', NULL, 'https://i.ytimg.com/vi/iqtlFAfl2wQ/mqdefault.jpg', NULL, 'iqtlFAfl2wQ', '0:5:8', 1, 'php,html,gsviec,hoc-php-can-ban', 791, 0, 1489717752, 1490757910, 1490757910, 'active', 'N', 0, 'N', 'N', 'N'),
(4, 16, 'video', 'youtube', 'Giới thiệu trình soạn thảo code Sublime text', NULL, 'gioi-thieu-trinh-soan-thao-code-sublime-text', 'Trong video này tôi sẽ hướng dẫn các bạn cách cài dặt trình soạn thảo Sublime text và giới thiệu tính năng cơ bản của nó, cuối cùng là gải thích tại sao bạn nên dùng nó\r\n\r\nĐể xem nhiều video bạn có thể xem trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/jk7nZSHQzS4/mqdefault.jpg', NULL, 'jk7nZSHQzS4', '0:3:50', 10, 'php,sublimetext,gsviec,trinh soan thao', 289, 0, 1489737666, 1490690592, 1490690592, 'active', 'N', 0, 'N', 'N', 'N'),
(5, 16, 'video', 'youtube', 'Giới thiệu IDE PHPSTORM', NULL, 'gioi-thieu-ide-phpstorm', 'Trong video này tôi sẽ giới thiệu các bạn một IDE cực mạnh để phát triển ứng dụng PHP đó là PhpStorm\r\n\r\nBạn có thể muốn xem các video khác tại https://gsviec.com', NULL, 'https://i.ytimg.com/vi/-WJoiJygNi0/mqdefault.jpg', NULL, '-WJoiJygNi0', '0:6:16', 10, 'phpstorm,php,editor,ide', 258, 0, 1489739332, 1490743887, 1490743887, 'active', 'N', 0, 'N', 'N', 'N'),
(6, 16, 'video', 'youtube', 'Giới thiệu tổng quan về Git và Github', NULL, 'gioi-thieu-tong-quan-ve-git-va-github', 'Git và Github được sử dụng khá phổ biến trong giới lập trình viên, chắc hẳn bạn sẽ thấy nhiều đường kho mã nguồn có link từ Github.com. Nó rất tiện lợi và an toàn, đáp ứng tốt các nhu cầu làm việc nhóm. Để sử dụng Git và Github bạn cần có những kiến thức cơ bản dòng lệnh trên Linux (vì cơ bản Git được xây dựng trên Linux).', NULL, 'https://i.ytimg.com/vi/bZQYowFKbns/mqdefault.jpg', NULL, 'bZQYowFKbns&feature=youtu.be', '0:3:52', 10, 'github,git,gsviec,devops,tool,hoc lap trinh', 515, 0, 1489758094, 1490743876, 1490743876, 'active', 'N', 0, 'N', 'N', 'N'),
(7, 16, 'video', 'youtube', 'Giới thiệu Bitbucket', NULL, 'gioi-thieu-bitbucket', 'Nếu bạn nào đã tứng sử dụng Github thì cũng biết nó có một nhược điểm đó là chi phí cho gói private khá là mắc, so với người dùng cá nhân do đó hôm nay tôi giới thiệu bạn Bitbucket nó cũng như Github nhưng có gói private miển phí cho bạn', NULL, 'https://i.ytimg.com/vi/Uuz1gIDHBkE/mqdefault.jpg', NULL, 'Uuz1gIDHBkE', '0:2:53', 10, 'bitbucket,devops,github,git,luu tru code,gsviec,yt:crop=16:9', 277, 0, 1489770183, 1490738861, 1490738861, 'active', 'N', 0, 'N', 'N', 'N'),
(8, 16, 'video', 'youtube', 'Hướng dẫn cài đặt Git và Github trên Window', NULL, 'huong-dan-cai-at-git-va-github-tren-window', 'Trong video này tôi sẽ hướng dẫn các bạn cài git, mặc định bạn có thể vào trang chủ git tải nó về và cài đặt, nhưng bạn nên cài cài github GUI nó sẽ cài cho bạn cả git và GUI Github thuận tiện hơn cho việc quản lý code sau này', NULL, 'https://i.ytimg.com/vi/zU2s7SbClaw/mqdefault.jpg', NULL, 'zU2s7SbClaw&feature=youtu.be', '0:2:24', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git,github,window', 441, 0, 1489896537, 1490757897, 1490757897, 'active', 'N', 0, 'N', 'N', 'N'),
(9, 16, 'video', 'youtube', 'Làm quen giao diện trên Github', NULL, 'lam-quen-giao-dien-tren-github', 'Trong bài học này tôi sẽ giới thiệu các bạn về giao diện của Github như là tạo một tổ chức hoặc công ty dùng để chứa mã nguồn code, và giải thích lý do tại sao bạn nên làm thế\r\n\r\nBạn có thể xem nhiều video nữa trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/M3cUVKDWTyA/mqdefault.jpg', NULL, 'M3cUVKDWTyA', '0:5:36', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec', 322, 0, 1489898154, 1490738572, 1490738572, 'active', 'N', 0, 'N', 'N', 'N'),
(10, 16, 'video', 'youtube', 'Thiết lập chứng thực cá nhân cho git', NULL, 'thiet-lap-chung-thuc-ca-nhan-cho-git', 'Trong bài học này tôi sẽ hướng dẫn các bạn cách cấu hình git trước khi bạn commit(đưa) code lên github, cũng như tạo một một repo trên github và cuối cùng là invited một thành viên tham gia vào tổ chức\r\n\r\nTôi sẽ demo video này trên hai nền tảng đó là Window và MacOS. Bạn có thể xem nhiều video nữa trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/XHUZkjNbDdw/mqdefault.jpg', NULL, 'XHUZkjNbDdw', '0:6:29', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git,cau hinh github tren window', 374, 0, 1489915162, 1490717767, 1490717767, 'active', 'N', 0, 'N', 'N', 'N'),
(11, 16, 'video', 'youtube', 'Cấu hình SSH Key cho Github', NULL, 'cau-hinh-ssh-key-cho-github', 'Trong bài học này tôi sẽ hướng dẫn các bạn cách tạo ssh-key trên window, sau đó thêm ssh-key này vào config trên github để mỗi lần bạn commit(đưa) code lên Github không yêu cầu mật khẩu nữa.\r\n\r\nTôi sẽ demo video này trên hai nền tảng đó là Window và MacOS. Bạn có thể xem nhiều video nữa trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/52frYwwVceM/mqdefault.jpg', NULL, '52frYwwVceM', '0:4:45', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,ssh,github,git', 408, 0, 1489917053, 1490766443, 1490766443, 'active', 'N', 0, 'N', 'N', 'N'),
(12, 16, 'video', 'youtube', 'Cài đặt XAMP trên Window', NULL, 'cai-at-xamp-tren-window', 'XAMPP là môi trường phát triển web trên hệ điều hành Windows, Linux, Mac OS, Solaris. Nó cho phép bạn tạo các ứng dụng web với Apache2, PHP, Perl và MySQL. Bên cạnh đó, PhpMyAdmin cho phép quản lý cơ sở dữ liệu dễ dàng.\r\n\r\nNhưng bạn thường dùng XAMP cho Window thôi, chứ ít có ai dùng nó cho Linux:) ngoài ra XAMPP là viết tắt của các từ: Apache, MySQL, PHP và Perl.\r\n\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/-3B1vR7EVGo/mqdefault.jpg', NULL, '-3B1vR7EVGo', '0:9:18', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,xamp,window,lap trinh web php,hoc lap trinh web,moi truong phat trien web', 275, 0, 1489981992, 1490697315, 1490697315, 'active', 'N', 0, 'N', 'N', 'N'),
(13, 16, 'video', 'youtube', 'Cấu hình Virtual Host trong XAMPP', NULL, 'cau-hinh-virtual-host-trong-xampp', 'Virtual Host là một cấu hình trong Apache để cho phép nhiều domain cùng chạy trên một máy chủ. Có một khái niệm khác được đề cập tới trong Nginx cũng có chức năng tương tự như Virtual Host được gọi là Server Block. Trong Log này mình chỉ muốn chia sẻ với các bạn còn lạ lẫm về Vhost cách để cấu hình một Virtual Host trong Windows, ở đây mình sử dụng XAMPP làm môi trường pháp triển.\r\n\r\n```\r\n<VirtualHost *:80>\r\n  DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```\r\nTôi sẽ demo video này trên hai nền tảng đó là Window. Bạn có thể xem nhiều video nữa trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/dYSHMuVpZ98/mqdefault.jpg', NULL, 'dYSHMuVpZ98', '0:7:49', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,Virtual,host,xamp,window', 540, 0, 1489984522, 1490767584, 1490767584, 'active', 'N', 0, 'N', 'N', 'N'),
(14, 16, 'video', 'youtube', 'Tách mã PHP và HTML trong lập trình PHP', NULL, 'ta-ch-ma-php-va-html-trong-la-p-tri-nh-php', 'Bạn đã khá quen thuộc với viêc viết mã PHP và HTML, Css, javascript,... vào chung một tập tin php để thực thi câu lệnh PHP. Điều này làm code của bạn trở nên rối và khó quản lý.\r\n\r\nTrong video này tôi sẽ hướng dẫn các bạn cách tách mã code PHP và HTML ra riêng biệt để cho việc quản lý code dễ hơn cũng như maintainers dễ dàng hơn', NULL, 'https://i.ytimg.com/vi/rHjYO75Yne0/mqdefault.jpg', NULL, 'rHjYO75Yne0', '0:6:29', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,html,mvc,php can ban,hoc php', 622, 0, 1489998392, 1490759955, 1490759955, 'active', 'N', 0, 'N', 'N', 'N'),
(15, 16, 'video', 'youtube', 'Khóa học Docker Căn bản', NULL, 'khoa-hoc-docker-can-ban', 'Gần đây Docker đang được thảo luận và gây được nhiều chú ý trong cộng đồng công nghệ trên thế giới, với nhiều hứa hẹn trong tương lai. Các hãng công nghệ lớn như Google, Amazon, Microsoft đã bắt đầu hỗ trợ Docker trên nền tảng của họ, và ở Sài gòn có luôn cộng đồng Docker nếu bạn thích có thể tham gia meetup tại đây  Vậy Docker là gì?', NULL, 'https://i.ytimg.com/vi/tZS3JHq-GKs/mqdefault.jpg', NULL, 'tZS3JHq-GKs', '0:2:58', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,docker,dcoker composer', 1690, 0, 1490002534, 1490766686, 1490766686, 'active', 'N', 0, 'N', 'N', 'N'),
(16, 16, 'video', 'youtube', 'Giới thiệu mảng trong PHP', NULL, 'gioi-thieu-mang-trong-php', 'Cũng như bao ngôn ngữ lập trình khác. PHP cũng tồn tại một loại dữ liệu được gọi là mảng. Cụ thể hơn Mảng là 1 biến danh sách. Nghĩa là, một biến vốn chứa nhiều phần tử được tạo bởi các số hoặc chuỗi. Nó cho phép chúng ta lưu trữ, sắp xếp thứ tự và truy cập nhiều giá trị với một tên. Và cần lưu ý rằng một phần tử mảng luôn bắt đầu với giá trị là 0.', NULL, 'https://i.ytimg.com/vi/56Z0KXbXsTA/mqdefault.jpg', NULL, '56Z0KXbXsTA', '0:9:26', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,php can ban,lap trinh web,array trong php', 156, 0, 1490088723, 1490743880, 1490743880, 'active', 'N', 0, 'N', 'N', 'N'),
(17, 16, 'video', 'youtube', 'Giới thiệu phương thức GET và POST trong PHP', NULL, 'gioi-thieu-phuong-thuc-get-va-post-trong-php', 'Khi làm việc với bất kỳ hình thức Form nào trong PHP như tạo account, reset pasword, tìm kiếm thì dùng hai phương thức trên là không thể thiếu. Do đó video này tôi sẽ hướng dẫn các bạn cách dùng nó huy vọng bạn sẽ hiểu cách dùng nó', NULL, 'https://i.ytimg.com/vi/LUCFGIMYTyc/mqdefault.jpg', NULL, 'LUCFGIMYTyc&feature=youtu.be', '0:5:28', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,post,get,form trong php', 199, 0, 1490090673, 1490724607, 1490724607, 'active', 'N', 0, 'N', 'N', 'N'),
(18, 16, 'video', 'youtube', 'Giới thiệu boolean trong PHP', NULL, 'gioi-thieu-boolean-trong-php', '\"Boolean\" là một thuật ngữ rất đáng sợ, nhưng nó là đơn giản để hiểu. Đó là kiểu dữ liệu thể hiện một trong hai giá trị: đúng hoặc sai. Nó dường như là xuất hiện liên tục trong các dự án của bạn. Vì vậy, điều quan trọng trước khi làm các dự án PHP thực tế bạn cần phải hiểu nó', NULL, 'https://i.ytimg.com/vi/IDZoKpNLusw/mqdefault.jpg', NULL, 'IDZoKpNLusw&feature=youtu.be', '0:11:55', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,boolean,hoc lap trinh php', 184, 0, 1490153186, 1490717765, 1490717765, 'active', 'N', 0, 'N', 'N', 'N'),
(19, 16, 'video', 'youtube', 'Giới thiệu các lệnh căn bản thường dùng trong GIT', NULL, 'gioi-thieu-cac-lenh-can-ban-thuong-dung-trong-git', 'Trong bài học này tôi sẽ hướng dẫn các bạn các lệnh căn bản của git như:\r\n\r\n- git add: dùng để thêm file trước khi commit, ví dụ git add README.md, nếu bạn muốn thêm nhiều file thì dùng git add A\r\n\r\n- git commit: trước khi push code thì bạn có cần phải nói rõ ý nghĩa của đoạn code đó làm chức năng\r\n\r\n- git staus: xem bạn đã ở branch(nhánh) nào.\r\n\r\n- git push: đẩy code lênh repo trong trường hợp này là github\r\n\r\n- git pull: kéo code về từ remote repo\r\n\r\n\r\nTôi sẽ demo video này trên hai nền tảng đó là Window và MacOS. Bạn có thể xem nhiều video nữa trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/L6kaDUzBvZ4/mqdefault.jpg', NULL, 'L6kaDUzBvZ4', '0:9:17', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git can ban', 325, 0, 1490158799, 1490733677, 1490733677, 'active', 'N', 0, 'N', 'N', 'N'),
(20, 16, 'video', 'youtube', 'Giới thiệu tính năng pull request và branch trong GIT', NULL, 'gioi-thieu-tinh-nang-pull-request-va-branch-trong-git', 'Trong bài học này tôi sẽ hướng dẫn các bạn các khái niệm branch và pull request là gì và cách dùng nó như thế nào\r\n\r\nTôi sẽ demo video này trên hai nền tảng đó là Window và MacOS. Bạn có thể xem nhiều video nữa trên https://gsviec.com', NULL, 'https://i.ytimg.com/vi/qOq1XHxrEi4/mqdefault.jpg', NULL, 'qOq1XHxrEi4&feature=youtu.be', '0:11:57', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,branch,pull request,git', 343, 0, 1490173087, 1490710943, 1490710943, 'active', 'N', 0, 'N', 'N', 'N'),
(21, 16, 'video', 'youtube', 'Backup dữ liệu wordpress  qua GIT', NULL, 'backup-du-lieu-wordpress-qua-git', 'Nếu như các bạn muốn tracking hay backup mã nguồn wordpress trên VPS của bạn thì video này dành cho bạn\r\n\r\nĐể xem nhiều video hơn bạn có thể truy câp vào https://gsviec.com', NULL, 'https://i.ytimg.com/vi/Bi3jKNK0BU8/mqdefault.jpg', NULL, 'Bi3jKNK0BU8&feature=youtu.be', '0:3:54', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,backkup,git,bitbucket', 212, 0, 1490241215, 1490759953, 1490759953, 'active', 'N', 0, 'N', 'N', 'N'),
(22, 16, 'video', 'youtube', 'Reset, Revert va amend trong GIT', NULL, 'reset-revert-va-amend-trong-git', 'Một việc bạn sẽ khá thường xuyên làm trong Git nếu làm việc theo nhóm đó là kiểm tra xem những ai đã commit vào dự án bạn đang làm việc, cũng như cách bạn undo lần commit trước đó nếu như bạn cảm thấy mình thiếu một tập tin nào đó trong lần commit trước để bổ sung vào.', NULL, 'https://i.ytimg.com/vi/XHSo4g-UHBY/mqdefault.jpg', NULL, 'XHSo4g-UHBY&feature=youtu.be', '0:8:42', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,git,github,revert,reset', 376, 0, 1490242361, 1490757904, 1490757904, 'active', 'N', 0, 'N', 'N', 'N'),
(23, 16, 'video', 'youtube', 'Giới thiệu gitignore trong GIT', NULL, 'gioi-thieu-gitignore-trong-git', 'Khi quản lý mã nguồn code với GIT thì có những file mà ta không muốn commit code lên chẳn hạn như file cấu hình password, file biên dịch, file sinh ra do vagrant hay IDE', NULL, 'https://i.ytimg.com/vi/2Unjp00KYpo/mqdefault.jpg', NULL, '2Unjp00KYpo&feature=youtu.be', '0:3:41', 4, 'php,yt:quality=high,yt:crop=16:9,gsviec,gitignore,git', 306, 0, 1490244982, 1490738617, 1490738617, 'active', 'N', 0, 'N', 'N', 'N'),
(24, 16, 'video', 'youtube', 'Cài đặt Wordpress trên Window', NULL, 'cai-at-wordpress-tren-window', 'Trên thực tế có nhiều cách để bạn cài và thiết lập WordPress, nhưng GSVIEC xin giới thiệu với mọi người cách install WordPress cùng với XAMPP trên localhost để thử nghiệm trước.', NULL, 'https://i.ytimg.com/vi/h7OwQFftNqg/mqdefault.jpg', NULL, 'h7OwQFftNqg&feature=youtu.be', '0:2:13', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,localhost,xamp', 182, 0, 1490245150, 1490732525, 1490732525, 'active', 'N', 0, 'N', 'N', 'N'),
(25, 16, 'video', 'youtube', 'Backup dữ liệu Wrodpress qua SSH', NULL, 'backup-du-lieu-wrodpress-qua-ssh', 'Việc Backup dữ liệu là điều cần thiết không thể tránh  khỏi nếu như bạn đang vận hành một Website, do đó trong video này tôi sẽ hướng dẫn bạn dùng lệnh SCP để backup', NULL, 'https://i.ytimg.com/vi/DAkNMeqwhlk/mqdefault.jpg', NULL, 'DAkNMeqwhlk&feature=youtu.be', '0:2:29', 10, 'php,yt:quality=high,yt:crop=16:9,gsviec,scp,ssh', 255, 0, 1490245818, 1490743878, 1490743878, 'active', 'N', 0, 'N', 'N', 'N'),
(26, 16, 'video', 'youtube', 'Tổng quan giao diện Wordpress', NULL, 'tong-quan-giao-dien-wordpress', 'Như bạn biết thì để học một cái gì đó nhanh nhất thì chúng ta cần phải có cái nhìn tổng quan về nó, vì vậy trong video này tôi sẽ giới thiệu các bạn tổng quan Wordpress', NULL, 'https://i.ytimg.com/vi/E34vKbpskfg/mqdefault.jpg', NULL, 'E34vKbpskfg&feature=youtu.be', '0:5:34', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,wp can ban,wordpress can ban', 325, 0, 1490327772, 1490766356, 1490766356, 'active', 'N', 0, 'N', 'N', 'N'),
(27, 16, 'video', 'youtube', 'Cách đăng bài viết trong wordpress', NULL, 'cach-ang-bai-viet-trong-wordpress', 'Hướng dẫn viết bài và đăng bài viết với tính năng Post bài trên WordPress', NULL, 'https://i.ytimg.com/vi/z0rohb_AmfA/mqdefault.jpg', NULL, 'z0rohb_AmfA&feature=youtu.be', '0:5:22', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress', 287, 0, 1490327816, 1490743882, 1490743882, 'active', 'N', 0, 'N', 'N', 'N'),
(28, 16, 'video', 'youtube', 'Cấu hình Vhost trên XAMP cho Wordpress', NULL, 'cau-hinh-vhost-tren-xamp-cho-wordpress', 'Việc dùng mặc định đường dẫn khi bạn cài đặt Wordpress trên XAMP không có vấn đề gì cả, nhưng nhìn nó không chuyên nghiệp cũng như không giống thực tế của một domain do đó trong video này tôi sẽ hướng dẫn bạn thây đổi domain cho nó.\r\n\r\nBạn có thể copy đoạn code dưới đây để dán vào http.conf\r\n\r\n```\r\n<VirtualHost *:80>\r\n    DocumentRoot \"C:/xampp/htdocs/hello\"\r\n  ServerName gsviec.dev\r\n   <Directory \"C:/xampp/htdocs/hello\">\r\n       Order allow,deny\r\n        Allow from all\r\n  </Directory>\r\n</VirtualHost>\r\n\r\n```', NULL, 'https://i.ytimg.com/vi/1Krr5OedGy0/mqdefault.jpg', NULL, '1Krr5OedGy0&feature=youtu.be', '0:5:52', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,wordpress can ban,xamp,vhost', 273, 0, 1490329114, 1490757899, 1490757899, 'active', 'N', 0, 'N', 'N', 'N'),
(29, 16, 'video', 'youtube', 'Cài đặt Plugin và Theme trong Wordpress', NULL, 'cai-at-plugin-va-theme-trong-wordpress', 'Như bạn biết đó là khi cài đặt xong WordPress thì công việc tiếp theo là cài đặt các theme và plugin để giúp cho website ngon hơn, do đó trong video này tôi sẽ hướng dẫn các bạn cài đặt nó\r\n\r\nNếu bạn cài trren XAMP sẽ không bị lỗi đòi FTP,  còn Linux sẽ gặp lỗi thì bạn xem bài viết https://gsviec.com/blog/tat-tai-khoan-ftp-khi-upload-theme-trong-wordpress để khắc phục', NULL, 'https://i.ytimg.com/vi/QGe8hCbWt_0/mqdefault.jpg', NULL, 'QGe8hCbWt_0&feature=youtu.be', '0:6:8', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,wordpress can ban,plugin,theme,ftp', 281, 0, 1490330086, 1490752130, 1490752130, 'active', 'N', 0, 'N', 'N', 'N'),
(30, 16, 'video', 'youtube', 'Cách tạo menu trong Wordpress', NULL, 'cach-tao-menu-trong-wordpress', 'Menu là chức năng không thể thiếu của một website, do đó video này tôi sẽ hướng dẫn bạn tạo menu như trang abouts, cayegory', NULL, 'https://i.ytimg.com/vi/cbrTIDpX8BA/mqdefault.jpg', NULL, 'cbrTIDpX8BA&feature=youtu.be', '0:3:10', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,wordpress can ban,mernu,menu', 154, 0, 1490330746, 1490743110, 1490743110, 'active', 'N', 0, 'N', 'N', 'N'),
(31, 16, 'video', 'youtube', 'Quản lý video và hình ảnh trong Wordpress', NULL, 'quan-ly-video-va-hinh-anh-trong-wordpress', 'Wordpress cung cấp cho ta một trình quản lý media thật là tuyệt vời, với nó việc thêm hay xoá hình ảnh không thể dễ dàng hơn', NULL, 'https://i.ytimg.com/vi/Dw8L7pCi1lA/mqdefault.jpg', NULL, 'Dw8L7pCi1lA&feature=youtu.be', '0:2:28', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,media,video,image,quan ly hinh anh', 267, 0, 1490350799, 1490743884, 1490743884, 'active', 'N', 0, 'N', 'N', 'N'),
(32, 16, 'video', 'youtube', 'Quản lý User trong Wordpress', NULL, 'quan-ly-user-trong-wordpress', 'Bất cứ nền tảng CMS nào thì phân quyền cho user truy cập cho tài nguyên là điều cần thiết, vì vậy trong video này tôi sẽ giới thiệu tính năng quản lý mặc định trong Wordpress', NULL, 'https://i.ytimg.com/vi/MmL3dZsDHrU/mqdefault.jpg', NULL, 'MmL3dZsDHrU&feature=youtu.be', '0:5:8', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,quan ly user', 128, 0, 1490350852, 1490625910, 1490625910, 'active', 'N', 0, 'N', 'N', 'N'),
(33, 16, 'video', 'youtube', 'Giới thiệu phần Setting trong Wordpress', NULL, 'gioi-thieu-phan-setting-trong-wordpress', 'Ở trong bài hướng dẫn về Settings này, mình sẽ hướng dẫn qua chi tiết từng thiết lập có trong mỗi phần ở khu vực Settings này. Dĩ nhiên, tôi sẽ chỉ nói qua các phần thiết lập có mặc định trong WordPress chứ không thể hướng dẫn luôn các thiết lập plugin khác có trong khu vực này được', NULL, 'https://i.ytimg.com/vi/979U34kR-m0/mqdefault.jpg', NULL, '979U34kR-m0&feature=youtu.be', '0:8:22', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,setting,media,permalink', 267, 0, 1490411368, 1490757908, 1490757908, 'active', 'N', 0, 'N', 'N', 'N'),
(34, 16, 'video', 'youtube', 'Khóa Học  WordPress Căn Bản', NULL, 'khoa-hoc-wordpress-can-ban', 'Trong serie bài học này, bạn sẽ bắt đầu từ những kiến thức cơ bản nhất cực kỳ cần thiết đối với tất cả những người có mong muốn tự làm và quản trị được một website bằng WordPress.\r\n\r\n\r\nBạn sẽ tự làm được ít nhất một website hoàn chỉnh. Sau này không cần thuê ai nữa, thích web nào là làm web đó. Thiết kế web không khó như bạn tưởng. Học MỘT lần, dùng CẢ ĐỜI!', NULL, 'https://i.ytimg.com/vi/jxp-cl3uIk0/mqdefault.jpg', NULL, 'jxp-cl3uIk0&feature=youtu.be', '0:0:58', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress', 320, 0, 1490411701, 1490757895, 1490757895, 'active', 'N', 0, 'N', 'N', 'N'),
(35, 16, 'video', 'youtube', 'Giới thiệu Category và Tag', NULL, 'gioi-thieu-category-va-tag', 'Category nghĩa là một nhóm bao quát chứa các bài viết trong blog. Nó giống như những cái cặp giấy và các tờ giấy là những bài viết được chứa ở trong đó. Category có thể được phân cấp, tức là một Category có thể bao gồm nhiều Category nhỏ khác ở trong.\r\n\r\nTag nghĩa là một phép phân loại đặc biệt của bài viết để mô tả cụ thể các chủ đề liên quan. Nếu ta xem Category là cặp sách, bài viết là giấy thì Tag cũng được xem là những cái kẹp giấy để kẹp một số bài viết có liên quan lại với nhau.', NULL, 'https://i.ytimg.com/vi/6OdX1dAw-is/mqdefault.jpg', NULL, '6OdX1dAw-is&feature=youtu.be', '0:3:25', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,wordpress,tag,cat,category', 204, 0, 1490412009, 1490692639, 1490692639, 'active', 'N', 0, 'N', 'N', 'N'),
(36, 16, 'video', 'youtube', 'Giới thiệu Plugin FakerPress để tạo dữ liệu', NULL, 'gioi-thieu-plugin-fakerpress-e-tao-du-lieu', 'Chào các bạn, hôm nay tôi sẽ giới thiệu các bạn dùng một thư viện đó là Faker để tạo ra giữ liệu giả cho trang web của chúng ta. Như các bạn biết việc dùng dữ liệu thật  trong môi trường development là một ý tưởng rất là tệ.\r\n\r\nBạn có thể xem bài viết về faker tại đây https://gsviec.com/blog/huong-dan-dung-faker-de-tao-du-lieu-cho-moi-truong-phat-trien', NULL, 'https://i.ytimg.com/vi/vJOAALPgMaE/mqdefault.jpg', NULL, 'vJOAALPgMaE&feature=em-upload_owner', '0:7:45', 2, 'php,yt:quality=high,yt:crop=16:9,gsviec,fakerpress,fakedata,wordpress', 277, 0, 1490412301, 1490749508, 1490749508, 'active', 'N', 0, 'N', 'N', 'N'),
(37, 16, 'video', 'youtube', 'Chọn Editor hoặc IDE phù hợp để viết code', NULL, 'chon-editor-hoac-ide-phu-hop-e-viet-code', 'Như bạn biết là để viết code PHP thì ta có thể dùng notepad để viết cũng được nhưng không ai làm thế cả, vì vậy tôi sẽ đưa cho bạn những lời khuyên chọn IDE hay Editor hợp lý khi bắt đầu học PHP', NULL, 'https://i.ytimg.com/vi/G4aUHNZlWP4/mqdefault.jpg', NULL, 'G4aUHNZlWP4&feature=youtu.be', '0:2:4', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,editor,ide,sublimetext,atom,phpstorm', 778, 0, 1490447099, 1490759946, 1490759946, 'active', 'N', 0, 'N', 'N', 'N'),
(38, 16, 'video', 'youtube', 'Cài đặt môi trường phát triển PHP', NULL, 'cai-at-moi-truong-phat-trien-php', 'Để cài đặt môi trường phát triển PHP thì có khá là nhiều cách nhưng có lẻ cách đơn giản nhất là dùng XAMP để phát triển PHP\r\n\r\nVì vậy trong video này tôi sẽ hướng dấn cách bạn cài đặt trên Window, còn trên Mac hay Linux thì tương tự', NULL, 'https://i.ytimg.com/vi/QcMxYYsLOyU/mqdefault.jpg', NULL, 'QcMxYYsLOyU&feature=youtu.be', '0:5:4', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,moi truong phat trien php,xamp', 233, 0, 1490452451, 1490753020, 1490753020, 'active', 'N', 0, 'N', 'N', 'N'),
(39, 16, 'video', 'youtube', 'Lời mở đầu', NULL, 'loi-mo-au', 'Nhận thấy có nhiều bạn trẻ muốn học PHP để phát triển web nhưng chưa có kiến thức căn bản về nó, vì vậy tôi quyết định mở khoá học Lập trình PHP\r\n\r\nKhoá học php căn bản dành cho các bạn mới tìm hiểu về PHP, chương trình đào tạo từ những cái cơ bản nhất đến chuyên sâu. Sau khi kết thúc khóa học căn bản bạn có thể viết được một website cơ bản.\r\n\r\nBạn có thể xem đầy đủ video tại đây https://gsviec.com/playlist/khoa-hoc-php-can-ban', NULL, 'https://i.ytimg.com/vi/fO8SaxPAdBI/mqdefault.jpg', NULL, 'fO8SaxPAdBI&feature=youtu.be', '0:1:27', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,php can ban,hoc lap trimh php', 239, 0, 1490498484, 1490729131, 1490729131, 'active', 'N', 0, 'N', 'N', 'N'),
(40, 16, 'video', 'youtube', 'Câu điều kiện trong PHP', NULL, 'cau-ieu-kien-trong-php', 'Câu điều kiện dùng để thực hiện những hành động khác nhau trong những điều kiện khác nhau. Câu điều kiện rất thường xuyên được sử dụng khi viết mã cho bất kỳ ngôn ngữ lập trình nào.\r\n\r\nCâu điều kiện thường được sử dụng trong PHP là câu điều kiện IF, trong video này tôi sẽ hướng dẫn bạn cách dùng nó', NULL, 'https://i.ytimg.com/vi/CY5tb6T41sA/mqdefault.jpg', NULL, 'CY5tb6T41sA&feature=youtu.be', '0:6:48', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,condition,cau dien kien php,if va else', 180, 0, 1490503601, 1490745212, 1490745212, 'active', 'N', 0, 'N', 'N', 'N'),
(41, 16, 'video', 'youtube', 'Khái niệm về hàm và gọi lại hàm trong PHP', NULL, 'khai-niem-ve-ham-va-goi-lai-ham-trong-php', 'Để giảm thời gian lặp lại 1 thao tác code nhiều lần, PHP hỗ trợ người lập trình việc tự định nghĩa cho mình những hàm có khả năng lặp lại nhiều lần trong website. Việc này cũng giúp cho người lập trình kiểm soát mã nguồn một cách mạch lạc. Đồng thời có thể tùy biến ở mọi trang. Mà không cần phải khởi tạo hay viết lại mã lệnh như HTML thuần.\r\n\r\n### Cú pháp\r\n\r\n```\r\n\r\n\r\nfunction ten_function($gt1,$gt2){\r\n\r\n//Hành động\r\n\r\n}\r\n```', NULL, 'https://i.ytimg.com/vi/tKZP-JxmL7k/mqdefault.jpg', NULL, 'tKZP-JxmL7k&feature=em-upload_owner', '0:5:24', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,function trong php,function', 661, 0, 1490590971, 1490759944, 1490759944, 'active', 'N', 0, 'N', 'N', 'N'),
(42, 16, 'video', 'youtube', 'Giới thiệu MySQL', NULL, 'gioi-thieu-mysql', 'Khi bạn tìm kiếm trên Goole từ khoá như học lập trình web, hay cài đặt WordPress bạn sẽ thấy có một cụm từ là Mysql, vậy nó là gì trong bài viết này tôi sẽ giải thích Mysql là gì tại sao nó là cần thiết.', NULL, 'https://i.ytimg.com/vi/VyGUn3aJFv4/mqdefault.jpg', NULL, 'VyGUn3aJFv4', '0:10:7', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,mysql,php can ban', 490, 0, 1490591584, 1490763264, 1490763264, 'active', 'N', 0, 'N', 'N', 'N'),
(43, 16, 'video', 'youtube', 'Giới thiệu class PDO', NULL, 'gioi-thieu-class-pdo', 'PDO là API cung cấp cho chúng ta để kết nối cũng như thao tác với CSDL, chuyển dữ liệu thành các đối tượng để chúng ta dễ thao tác. Hiện tai PDO hỗ trợ khoảng 12 loại hệ quản trị CSDL khác nhau, không giống như mysqli chỉ hỗ trợ MySQL. PDO ra đời đã làm cho PHP đã mạnh lại càng trở nên mạnh mẽ hơn.', NULL, 'https://i.ytimg.com/vi/vNgOGMjA9D4/mqdefault.jpg', NULL, 'vNgOGMjA9D4', '0:11:43', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,pdo,php can ban', 388, 0, 1490593241, 1490759942, 1490759942, 'active', 'N', 0, 'N', 'N', 'N'),
(44, 16, 'video', 'youtube', 'Tái cấu trúc (refactor) lại đoạn PDO', NULL, 'tai-cau-truc-refactor-lai-oan-pdo', 'Tái cấu trúc (refactor) lại đoạn code của bạn, để hiểu rõ refactor là gì thì bạn có thể hiểu như sau:\r\n\r\nRefactoring không đơn giản là làm cho code mình rõ ràng hơn mà còn là cách bố cục lại code sao cho nó thành các part (thông thường, người ta đưa các xử lý, thuật toán thành các method), tối ưu thuật toán, tổ chức lại biến...để làm sao nó (là class, hay lớn hơn là module) có thể được sử dụng lại ở đâu đó, hay để nâng cấp dễ dàng (hạn chế các xung đột hay chỉnh sửa quá nhiều trong system mới)\r\n', NULL, 'https://i.ytimg.com/vi/3sr60LPcpQ4/mqdefault.jpg', NULL, '3sr60LPcpQ4&feature=youtu.be', '0:16:51', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,pdo,refactor,tai cau truc code,php can ban', 156, 0, 1490672521, 1490675529, 1490675529, 'active', 'N', 0, 'N', 'N', 'N'),
(45, 16, 'video', 'youtube', 'Bảo vệ thông tin mật khẩu', NULL, 'bao-ve-thong-tin-mat-khau', 'Phần cấu hình thông tin của Server bạn là rất quan trọng chẵn hạn như mật khẩu database, mật khẩu dịch vụ sendmail... Việc bảo vệ nó là cần thiết do đó bạn nên đặt nó vào một tập tin nào đó, không nên khai báo thông tin mật khẩu ở khắp mọi nơi để tránh bị hacker tấn công\r\n\r\nNgoài ra việc đặt các thông tin vào một tập tin cấu hình giúp ta quản lý code dễ dàng hơn. Để xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/O1NqsU6Nikc/mqdefault.jpg', NULL, 'O1NqsU6Nikc&feature=youtu.be', '0:10:12', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec', 580, 0, 1490673274, 1490766347, 1490766347, 'active', 'N', 0, 'N', 'N', 'N'),
(46, 16, 'video', 'youtube', 'Upload tập tin trong PHP(FORM-phần 3)', NULL, 'upload-tap-tin-trong-php-form-phan-3', 'Khi làm việc với web động đặc biệt là với PHP thì việc upload tập tin như hình ảnh, video là không thể thiếu, trong video này tôi sẽ hướng dẫn sử dụng hàm $_FILES để xử lý file trong PHP\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/CWHWN5De-h4/mqdefault.jpg', NULL, 'CWHWN5De-h4', '0:26:20', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,upload,upload file trong php,php can ban', 157, 0, 1490932995, NULL, 1490933016, 'active', 'N', 0, 'N', 'N', 'N'),
(47, 16, 'video', 'youtube', 'Xử lý Form trong PHP(Form-phần 1)', NULL, 'xu-ly-form-trong-php-form-phan-1', 'Một trong những ứng dụng quan trọng của PHP đó là giúp tương tác xử lý dữ liệu trên form của người sử dụng. Nhằm mục đích giúp cập nhật thông tin một cách linh động và dễ dàng quản lý chung hơn bởi sự kết hợp tuyệt vời của cơ sở dữ liệu. Tuy nhiên để làm được điều ấy PHP yêu cầu form phải đáp ứng 1 số quy định chung đặt ra.\r\n\r\nPOST: Bảo mật hơn GET vì dữ liệu được gửi ngầm, không xuất hiện trên URL.\r\n\r\nGET: Dữ liệu được gửi tường minh, chúng ta có thể nhìn thấy trên URL, đây là lý do khiến nó không bảo mật so với POST.\r\n\r\nGET thực thi nhanh hơn POST vì những dữ liệu gủi đi luôn được webbrowser cached lại. Khi dùng phương thức POST thì server luôn thực thi và trả về kết quả cho client, còn phương thức GET ứng với cùng một yêu cầu đó webbrowser sẽ xem trong cached có kết quả tương ứng với yêu cầu đó không và trả về ngay không cần phải thực thi các yêu cầu đó ở phía server.\r\n\r\nĐối với những dữ liệu luôn được thay đổi thì chúng ta nên sử dụng phương thức POST, còn dữ liệu ít thay đổi chúng ta dùng phương thức GET để truy xuất và xử lý nhanh hơn.', NULL, 'https://i.ytimg.com/vi/L8nIbVyC5Fs/mqdefault.jpg', NULL, 'L8nIbVyC5Fs&feature=youtu.be', '0:9:1', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec', 172, 0, 1490933576, NULL, 1491037434, 'active', 'N', 0, 'N', 'N', 'N'),
(48, 16, 'video', 'youtube', 'Xử lý Form phần 2', NULL, 'xu-ly-form-phan-2', 'Một trong những ứng dụng quan trọng của PHP đó là giúp tương tác xử lý dữ liệu trên form của người sử dụng. Nhằm mục đích giúp cập nhật thông tin một cách linh động và dễ dàng quản lý chung hơn bởi sự kết hợp tuyệt vời của cơ sở dữ liệu. Tuy nhiên để làm được điều ấy PHP yêu cầu form phải đáp ứng 1 số quy định chung đặt ra.\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/vcqHQRq5b4o/mqdefault.jpg', NULL, 'vcqHQRq5b4o', '0:10:30', 1, 'php,yt:quality=high,yt:crop=16:9,gsviec,xu kly form trong php', 138, 0, 1490934244, NULL, 1490934251, 'active', 'N', 0, 'N', 'N', 'N'),
(49, 16, 'video', 'youtube', 'Cài đặt Docker', NULL, 'cai-at-docker', 'Để cài đặt Docker thì bạn vào trang chủ https://docs.docker.com/engine/installation/ sau đó chọn phiên bản bạn muốn cài đặt.\r\n\r\nDocker được công bố tại Santa Clara, California, on March 15, 2013 bởi Solomon Hykes ban đầu nó viết bằng Python nhưng về sau nó được viết lại golang bởi hiệu năng của nó.\r\n\r\nBởi vì Docker sử dụng công nghệ LXC do đó nếu bạn muốn tìm hiểu sau hơn thì có thể tham khảo https://linuxcontainers.org/\r\n\r\nContainers Nó không phải là một Virtual Machines\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/LdWCZDaoMzU/mqdefault.jpg', NULL, 'LdWCZDaoMzU&feature=youtu.be', '0:2:37', 6, 'yt:quality=high,yt:crop=16:9,gsviec,cai dat docker,docker can ban,docker', 1209, 0, 1491403930, NULL, 1491403941, 'active', 'N', 0, 'N', 'N', 'N'),
(50, 16, 'video', 'youtube', 'Hello world trong Docker', NULL, 'hello-world-trong-docker', 'Như mọi công nghệ và ngôn ngữ lập trình thì ứng dụng Hello World luôn luôn được dùng để thử ngôn ngữ đó hay công nghệ đó\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/KZPqdqAOBUE/mqdefault.jpg', NULL, 'KZPqdqAOBUE&feature=youtu.be', '0:3:0', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec', 993, 0, 1491403968, NULL, 1491403987, 'active', 'N', 0, 'N', 'N', 'N'),
(51, 16, 'video', 'youtube', 'Chạy chế độ ngầm trong Docker', NULL, 'chay-che-o-ngam-trong-docker', 'Trong video này tôi sẽ hướng dẫn các bạn kết nối một contanier trong background(ngầm) ngoài ra bạn sẽ có khái niệm về image và container\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/J0vOGPcm_Xk/mqdefault.jpg', NULL, 'J0vOGPcm_Xk', '0:3:27', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,docker can ban,khoa hoc docker', 891, 0, 1491404050, NULL, 1491404058, 'active', 'N', 0, 'N', 'N', 'N'),
(52, 16, 'video', 'youtube', 'Giới thiệu tính năng CRUD trong Docker', NULL, 'gioi-thieu-tinh-nang-crud-trong-docker', 'Thì trong video này tôi sẽ hướng dẫn bạn các thao tác như tạo, thêm, xoá và sữa một container trong Docker\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/1lpLWUue8Ao/mqdefault.jpg', NULL, '1lpLWUue8Ao&feature=youtu.be', '0:4:57', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec', 714, 0, 1491404252, NULL, 1491404267, 'active', 'N', 0, 'N', 'N', 'N'),
(53, 16, 'video', 'youtube', 'Xây dựng một image Docker', NULL, 'xay-dung-mot-image-docker', 'Bạn đã hiểu làm thế nào để tải hình ảnh từ một đăng ký Docker công khai, nhưng bạn muốn xây dựng các hình ảnh của Docker cho riêng bạn.\r\n\r\nTrong video này tôi sẽ hướng dẫn bạn tạo image Docker thông qua tập tin Dockerfile\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/W7h-uMOEcu8/mqdefault.jpg', NULL, 'W7h-uMOEcu8&feature=youtu.be', '0:5:46', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,dockerfile,docker can ban,khoa hoc docker', 890, 0, 1491405168, NULL, 1491405177, 'active', 'N', 0, 'N', 'N', 'N'),
(54, 16, 'video', 'youtube', 'Xây dựng image Docker phần hai', NULL, 'xay-dung-image-docker-phan-hai', 'Tiếp tục phần tạo image docker trong phần này tôi sẽ giải thích các tham số cho bạn dễ hiểu hơn. và cách dùng nó như thế nào\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/LoS-JUhz_og/mqdefault.jpg', NULL, 'LoS-JUhz_og&feature=youtu.be', '0:7:17', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,docker can ban,docker image,dockerfile', 646, 0, 1491405908, NULL, 1491405921, 'active', 'N', 0, 'N', 'N', 'N'),
(55, 16, 'video', 'youtube', 'Chia sẻ Image Docker thông qua Hub Docker', NULL, 'chia-se-image-docker-thong-qua-hub-docker', 'Thì Docker là mã nguồn mở nên hưởng ứng theo tinh thần mã nguồn mở nên bạn muốn chia sẽ cái image bạn vừa mới tạo trên máy bạn thì làm thế nào. Trong video này tôi sẽ hướng dẫn bạn\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/Uscg4b-q3rU/mqdefault.jpg', NULL, 'Uscg4b-q3rU&feature=youtu.be', '0:3:37', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec,docker,chia se image docker', 473, 0, 1491406589, NULL, 1491406595, 'active', 'N', 0, 'N', 'N', 'N'),
(56, 16, 'video', 'youtube', 'Tự động tạo image thông qua hub docker', NULL, 'tu-ong-tao-image-thong-qua-hub-docker', 'Trong video trước tôi đã hướng dẫn các bạn cách tạo image docker trên máy local bạn, kế đế tôi sẽ hướng dẫn các bạn dùng hub.docker.com để tự động tạo image cho bạn một cách tự động mỗi khi bạn commit code lên github\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/ZoDZLrr6330/mqdefault.jpg', NULL, 'ZoDZLrr6330', '0:6:20', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec,github,hub docker,docker can ban', 427, 0, 1491407907, NULL, 1491407920, 'active', 'N', 0, 'N', 'N', 'N'),
(57, 16, 'video', 'youtube', 'Chạy ứng dụng Web Wordpress thông qua hai container', NULL, 'chay-ung-dung-web-wordpress-thong-qua-hai-container', '### Chạy ứng dụng Web Wordpress thông qua hai container\r\n\r\nBài toán đặt ra là bạn muốn chạy Wordpress với container Docker nhưng không phải một cái Container mặc định Wordpress mà bạn muốn chạy thêm một container MySQL để lưu trữ cơ sở dữ liệu\r\n\r\nCác bạn chú ý rằng bản thân cái Image Wordpress có thể chạy được mà không cần Image Mysql\r\n\r\n- Image MySQL: https://hub.docker.com/_/mysql\r\n\r\n- Imgage Wordpress: https://hub.docker.com/_/wordpress/\r\n\r\nTrước tiên tôi giả sử bạn đã có sẳn 2 cái image ở trên nếu chưa có thì chỉ việc chạy lệnh sau:\r\n\r\n```\r\ndocker pull mysql\r\ndocker pull wordpress\r\n\r\n```\r\n\r\nSau đó bạn tạo một container MySQL thông qua lệnh sau:\r\n\r\n```\r\ndocker run --name mysqlwp -e MYSQL_ROOT_PASSWORD=wordpressdocker -d mysql\r\n\r\n```\r\n\r\nBây giờ bạn tạo container Wordpress sử dụng tham số --link để kết nối Image MySQL ở trên thây vì dùng MySQL mặc định trong image Wordpress\r\n\r\n```\r\ndocker run --name wordpress --link mysqlwp:mysql -p 80:80 -d wordpress\r\n\r\n```\r\n\r\nCả 2 container trên tôi chạy trong chế độ background bạn có thể xác nhận thông qua lệnh sau:\r\n\r\n```\r\ndocker ps\r\n\r\n```\r\n\r\nbạn cũng có thể tạo container MySQL thông qua các biến bên dưới, tôi khuyên bạn nên dùg nó trong thực tế bởi vì chúng ta không nên dùng mặc định user root trong MYSQL\r\n\r\n```\r\ndocker run --name mysqlwp -e MYSQL_ROOT_PASSWORD=wordpressdocker \\\r\n                                -e MYSQL_DATABASE=wordpress \\\r\n                                -e MYSQL_USER=wordpress \\\r\n                                -e MYSQL_PASSWORD=wordpresspwd \\\r\n                                -d mysql\r\n```\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/mVco1U9b_Ao/mqdefault.jpg', NULL, 'mVco1U9b_Ao&feature=youtu.be', '0:4:32', 6, 'php,yt:quality=high,yt:crop=16:9,gsviec,docker,khoa hoc docker can ban,cai dat wordpress tren docker', 512, 0, 1491451582, NULL, 1491451722, 'active', 'N', 0, 'N', 'N', 'N'),
(58, 16, 'video', 'youtube', 'Backup dữ liệu MySQL đang chạy trong một Container', NULL, 'backup-du-lieu-mysql-ang-chay-trong-mot-container', 'Bài toán đặt ra là bạn muốn backup dữ liệu MySQL mà bạn đã cài đặt Wordpress trước đó, để tránh mất dữ liệu khi bạn xoá cái image MySQL\r\n\r\n### Giải pháp\r\n\r\nCó khá là nhiều các để làm nhưng có hai cách để làm chuyện này mà tôi cho là phổ biến và được khuyên dùng\r\n\r\n** Cách một**: Bạn dùng câu lệnh mysqldump trong MySQL mà ta thường dùng hằng ngày để backup dữ liệu.\r\n\r\n\r\n```\r\ndocker exec mysqlwp mysqldump --all-databases \\\r\n    --password=wordpressdocker > wordpress.backup\r\n                                    \r\n```\r\n\r\n**Cách hai**: Đó là bạn mount volume(kết nối nơi lưu trữ MySQL) của Imgae Docker bạn ra bên ngoài máy của bạn, giả sữ tôi muốn lưu trữ vào thư mục hiện tại tôi đang đứng:\r\n\r\n```\r\npwd\r\n\r\n#/Users/phanbook/github/khoa-hoc-docker-can-ban/wordpress/testdb\r\n\r\n```\r\nbạn chạy lệnh bên dưới sau:\r\n\r\n\r\n```\r\n\r\ndocker run --name mysqlwp -e MYSQL_ROOT_PASSWORD=wordpressdocker \\\r\n                                -e MYSQL_DATABASE=wordpress \\\r\n                                -e MYSQL_USER=wordpress \\\r\n                                -e MYSQL_PASSWORD=wordpresspwd \\\r\n                                -v $(pwd):/var/lib/mysql \\\r\n                                -d mysql\r\n\r\n```\r\n\r\nCách này là bạn phải chạy trước tiên nếu như bạn đã có sẵn cái container rồi \r\n', NULL, 'https://i.ytimg.com/vi/s_9BSAxqb0k/mqdefault.jpg', NULL, 's_9BSAxqb0k&feature=youtu.be', '0:8:52', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,docker can ban,backup mysql docker', 408, 0, 1491471566, NULL, 1491651572, 'active', 'N', 0, 'N', 'N', 'N'),
(59, 16, 'video', 'youtube', 'Chia sẽ data giữa máy bạn(Docker Host) với Container', NULL, 'chia-se-data-giua-may-ban-docker-host-voi-container', '**Bài toán**: Thì mục đích cuối cùng sau khi bạn thiết lập xong môi trường dev trên Docker thì bạn tạo thư mục A trên máy bạn thì trong container nó sẽ cũng có thư mục đó\r\n\r\n**Giải pháp**: Docker cung cấp cho ta một tham số -v để làm chuyện này\r\n\r\n```\r\n$ ls\r\nDockerfile        docker-compose.yml  index.php       wordpress\r\nconf\r\n\r\n$ docker run  -p  8080:9000 -d -v $(pwd):/var/www/html gsviec/php  php -S 0.0.0.0:9000\r\n\r\n```', NULL, 'https://i.ytimg.com/vi/gDbkfpYOoys/mqdefault.jpg', NULL, 'gDbkfpYOoys&feature=youtu.be', '0:2:41', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 378, 0, 1491471803, NULL, 1491651529, 'active', 'N', 0, 'N', 'N', 'N'),
(60, 16, 'video', 'youtube', 'Giới thiệu Docker Compose phần 1', NULL, 'gioi-thieu-docker-compose-phan-1', 'Theo như định nghĩa trên trang chủ thì nó là một công cụ dùng để quảng lý các contianer cũng như liên kết các image đó với nnau tham khảo tại đây https://docs.docker.com/compose/\r\n\r\n Bạn nên xem bài viết này để hiểu hơn https://gsviec.com/blog/gioi-thieu-docker-compose', NULL, 'https://i.ytimg.com/vi/HsLXh0opztk/mqdefault.jpg', NULL, 'HsLXh0opztk&feature=youtu.be', '0:6:41', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,docker compose,php', 559, 0, 1491707448, NULL, 1491707463, 'active', 'N', 0, 'N', 'N', 'N'),
(61, 16, 'video', 'youtube', 'Giới thiệu Docker Compose phần 2', NULL, 'gioi-thieu-docker-compose-phan-2', 'Theo như định nghĩa trên trang chủ thì nó là một công cụ dùng để quảng lý các contianer cũng như liên kết các image đó với nnau tham khảo tại đây https://docs.docker.com/compose/\r\n\r\nBạn nên xem bài viết này để hiểu hơn https://gsviec.com/blog/gioi-thieu-docker-compose', NULL, 'https://i.ytimg.com/vi/3OmdLbUZ1nA/mqdefault.jpg', NULL, '3OmdLbUZ1nA&feature=youtu.be', '0:5:23', 6, 'yt:quality=high,yt:crop=16:9,gsviec,docker,php,docker compose,khoa hoc docker,docker can ban', 357, 0, 1491707730, NULL, 1491707737, 'active', 'N', 0, 'N', 'N', 'N'),
(62, 16, 'video', 'youtube', 'Cài đặt Drupal trên Docker', NULL, 'cai-at-drupal-tren-docker', 'Drupal là CMS mã nguồn mở, miễn phí, xây dựng trên công nghệ PHP. Drupal giúp cho quá trình phát triển website trở nên đơn giản. Để cài đặt nó thì bạn có khá là nhiều cách nhưng trong video hôm nay tôi sẽ hướng dẫn bạn cách cài đặt Drupal trên Docker Compose\r\n\r\nNếu bạn nào có bất kỳ câu hỏi thì hãy để bình luận bên dưới tôi sẽ trả lời các bạn', NULL, 'https://i.ytimg.com/vi/9gxjlEM8pX0/mqdefault.jpg', NULL, '9gxjlEM8pX0', '0:6:24', 6, 'yt:quality=high,yt:crop=16:9,gsviec, docker,khoa-hoc-docker', 232, 0, 1491750949, NULL, 1491751073, 'active', 'N', 0, 'N', 'N', 'N'),
(63, 16, 'video', 'youtube', 'Cài đặt Phalcon trên Docker', NULL, 'cai-at-phalcon-tren-docker', 'Chắc có lẻ việc cài đặt Phalcon để dev có thể khá khó khăn đối với các bạn mới học. Nhưng với Docker các bạn chỉ cần một tập tin là bạn có thể chạy được Phalcon dễ dàng\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/NrePS8zsMnQ/mqdefault.jpg', NULL, 'NrePS8zsMnQ', '0:4:7', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 237, 0, 1491751254, NULL, 1491751273, 'active', 'N', 0, 'N', 'N', 'N'),
(64, 16, 'video', 'youtube', 'Cài đặt Magento 2 trên Docker', NULL, 'cai-at-magento-2-tren-docker', 'Cài đặt Magento 2 trên Docker thì trước tiên bạn phải tải mã nguồn magento 2 về, nếu các bạn không thích đăng ký thì có thể download thông qua link này https://goo.gl/cXYfWx\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/7ER3c58RDmI/mqdefault.jpg', NULL, '7ER3c58RDmI&feature=youtu.be', '0:7:18', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 457, 0, 1491787262, NULL, 1491787270, 'active', 'N', 0, 'N', 'N', 'N'),
(65, 16, 'video', 'youtube', 'Cài đặt Laravel trên Docker', NULL, 'cai-at-laravel-tren-docker', 'Nếu bạn nếu đã từng làm Laravel rồi thì nó cung cấp khá là nhiều công cụ cho các bạn phát triển như laravel homestead, laradock nhưng trong video này tôi sẽ hướng dẫn cho bạn cách đơn giản nhất để có môi trường phát triển laravel\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/scz8zdheQK4/mqdefault.jpg', NULL, 'scz8zdheQK4&feature=youtu.be', '0:3:58', 6, 'yt:quality=high,yt:crop=16:9,gsviec,cai dat laravel tren docker,khoa hoc docker,docker can ban', 470, 0, 1491787742, NULL, 1491787749, 'active', 'N', 0, 'N', 'N', 'N'),
(66, 16, 'video', 'youtube', 'Chạy composer php trong Docker', NULL, 'chay-composer-php-trong-docker', '**Composer** là một công cụ quản lý các thư viện trong PHP (Dependency Management), công cụ này giúp ta tiết kiệm khá nhiều thời gian với các gói thư việ cần thiết mà project của bạn cần sử dụng, bạn chỉ cần khai báo nó, composer sẽ tự động tải code của các thư viện về thông qua một server packagist.org\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/btLYLB3TA3I/mqdefault.jpg', NULL, 'btLYLB3TA3I&feature=youtu.be', '0:2:44', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 272, 0, 1491877717, NULL, 1491877725, 'active', 'N', 0, 'N', 'N', 'N'),
(67, 16, 'video', 'youtube', 'Tổng quan giao diện của Amazon Web Service', NULL, 'tong-quan-giao-dien-cua-amazon-web-service', 'Trong video này tôi sẽ giới thiệu các bạn giao diện quản trị người dùng của AWS nó cũng khá là đơn giản như tôi vẫn phải giới thiệu với các bạn\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/aRk177oAsew/mqdefault.jpg', NULL, 'aRk177oAsew&feature=youtu.be', '0:5:9', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc can ban', 443, 0, 1492397730, NULL, 1492397754, 'active', 'N', 0, 'N', 'N', 'N'),
(68, 16, 'video', 'youtube', 'Tạo tài khoản trên Amazon Web Service', NULL, 'tao-tai-khoan-tren-amazon-web-service', 'Như mọi dịch vụ để sử dụng nó bạn cần phải đăng ký, trước tiên bạn cần vào trang chủ http://aws.amazon.com/\r\n\r\nBạn cần phải có thẻ visa để đăng ký nếu chưa có thì ra ngân hàng ACB làm một cái ngay chỉ có 30 phút là có liền.\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/twyVw5_y908/mqdefault.jpg', NULL, 'twyVw5_y908&feature=youtu.be', '0:6:22', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc amazon can ban', 634, 0, 1492399144, NULL, 1492399156, 'active', 'N', 0, 'N', 'N', 'N'),
(69, 16, 'video', 'youtube', 'Tổng quan IAM trong Amazon Web Service', NULL, 'tong-quan-iam-trong-amazon-web-service', 'AWS có khá là nhiều dich vụ nếu như không phân quyền là cực kỳ nguy hiểm, do đó AWS có công cụ IAM dùng để làm chuyện đó. Trong video này tôi sẽ khái niệm căn bản cho các bạn như “security groups” và \"User\"\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/RWNoowdBSIw/mqdefault.jpg', NULL, 'RWNoowdBSIw&feature=youtu.be', '0:6:13', 6, 'yt:quality=high,yt:crop=16:9,gsviec,iam,aws', 398, 0, 1492400343, NULL, 1492400349, 'active', 'N', 0, 'N', 'N', 'N'),
(70, 16, 'video', 'youtube', 'Tổng quan S3 trên AWS', NULL, 'tong-quan-s3-tren-aws', 'Trong video này tôi sẽ giới thiêu căn bản cách sử dụng S3 và giới thiệu nó là gì.\r\n\r\nAmazon S3 là viết tắt của cụm từ Amazon Simple Storage Service: Là dịch vụ đám mây lưu trữ do đó bạn có thể tải lên các tệp, các tài liệu, các dữ liệu tải về của người dùng hoặc các bản sao lưu.\r\n\r\nBạn có thể xem bài viết này https://gsviec.com/blog/amazon-s3-la-gi-va-tai-sao-ban-nen-dung-no\r\n\r\nTrong video này tôi sẽ giới thiêu căn bản cách sử dụng S3 và giới thiệu nó là gì.\r\n\r\nAmazon S3 là viết tắt của cụm từ Amazon Simple Storage Service: Là dịch vụ đám mây lưu trữ do đó bạn có thể tải lên các tệp, các tài liệu, các dữ liệu tải về của người dùng hoặc các bản sao lưu.\r\n\r\nBạn có thể xem bài viết này https://gsviec.com/blog/amazon-s3-la-gi-va-tai-sao-ban-nen-dung-no\r\n\r\n\r\n```\r\n\r\n{\r\n    \"Version\": \"2008-10-17\",\r\n    \"Statement\": [\r\n        {\r\n            \"Sid\": \"AllowPublicRead\",\r\n            \"Effect\": \"Allow\",\r\n            \"Principal\": {\r\n                \"AWS\": \"*\"\r\n            },\r\n            \"Action\": \"s3:GetObject\",\r\n            \"Resource\": \"arn:aws:s3:::<tên-bucket-của ban>/*\"\r\n        }\r\n    ]\r\n}\r\n\r\n```', NULL, 'https://i.ytimg.com/vi/1PlWhYMMGVM/mqdefault.jpg', NULL, '1PlWhYMMGVM&feature=youtu.be', '0:11:2', 6, 'yt:quality=high,yt:crop=16:9,gsviec,s3,aws,cach dung aws can ban', 576, 0, 1492400395, NULL, 1492418117, 'active', 'N', 0, 'N', 'N', 'N');
