(71, 16, 'video', 'youtube', 'Lời mở đầu', NULL, 'loi-mo-au', 'Trong serie bài học này, bạn sẽ có các khái niệm căn bản về S3, EC2, Cách tính chi phí dịch vụ AWS, etc\r\n\r\nNgoài ra tôi sẽ hướng dẫn bạn cách sữ dụng S3 để chứa hình ảnh hoặc Video cho website của bạn mà cụ thể là Wordpress\r\n\r\nĐể xem chi tieét khoá học bạn có thể xem https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban', NULL, 'https://i.ytimg.com/vi/3R3kQJJIOw8/mqdefault.jpg', NULL, '3R3kQJJIOw8&feature=youtu.be', '0:1:3', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc aws', 722, 0, 1492506470, NULL, 1492506498, 'active', 'N', 0, 'N', 'N', 'N'),
(72, 16, 'video', 'youtube', 'Ước lượng chi phí khi dùng Amazon Web Service', NULL, 'uoc-luong-chi-phi-khi-dung-amazon-web-service', 'Bất kể bạn dùng dịch vụ là gì thì ưu tiên đầu tiên của bạn là chi phí do đó trong video này tôi sẽ hướng dẫn bạn cách tính chi phí khi dùng Amazon Web Service\r\n\r\nBạn cũng có thể muốn xem baì viết này để hiểu rõ hơn https://gsviec.com/blog/cach-tinh-cho-phi-dung-dich-vu-amazon-web-service\r\n\r\nBạn có thể xem đầy đủ khóa học tại đây https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban', NULL, 'https://i.ytimg.com/vi/Hy1QcIfPIVw/mqdefault.jpg', NULL, 'Hy1QcIfPIVw', '0:5:24', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoá hoc aws,tinh toan chi phi aws', 363, 0, 1492506941, NULL, 1492506948, 'active', 'N', 0, 'N', 'N', 'N'),
(73, 16, 'video', 'youtube', 'Sử dụng S3 để lưu trữ các tập satic', NULL, 'su-dung-s3-e-luu-tru-cac-tap-satic', 'Tuỳ thuộc vào mã nguồn hay ứng dụng của bạn thì cách thức sử dụng S3 là khác nhau, nhưng có một điều là giống nhau đó là đặt các tập tin css, javascript, image, video trên cái bucket của bạn\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/47nuJ1maBk0/mqdefault.jpg', NULL, '47nuJ1maBk0&feature=youtu.be', '0:3:56', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,khoa hoc aws', 340, 0, 1492507185, NULL, 1492507193, 'active', 'N', 0, 'N', 'N', 'N'),
(74, 16, 'video', 'youtube', 'Kết hợp hai dịch vụ S3 và Cloudfront với nhau', NULL, 'ket-hop-hai-dich-vu-s3-va-cloudfront-voi-nhau', 'Trong hai video trước tôi đã giới thiệu các bạn S3 và Cloudfront là gì rồi vì vậ trong video này tôi sẽ giải thích cho bạn làm thế nào kết hợp hai dịch vụ này làm việc chung với nhau\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/NbjfGx7xbNo/mqdefault.jpg', NULL, 'NbjfGx7xbNo&feature=youtu.be', '0:3:3', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,cloudfront,s3,khoa hoc aws', 304, 0, 1492507988, NULL, 1492507995, 'active', 'N', 0, 'N', 'N', 'N'),
(75, 16, 'video', 'youtube', 'Giới thiệu CloudFront của Amazon Web Service', NULL, 'gioi-thieu-cloudfront-cua-amazon-web-service', 'Amazon Cloudfront là mạng CDN phân phối nội dung tĩnh và streaming toàn cầu của Amazon. Khi bạn sử dụng CDN sẽ giúp cho khách truy cập nhanh vào dữ liệu máy chủ web gần họ nhất thay vì phải truy cập vào trung tâm dữ liệu của nhà cung cấp hosting bạn đang dùng.\r\n\r\nhttps://gsviec.com/blog/tang-toc-wordpress-voi-cloudfront', NULL, 'https://i.ytimg.com/vi/5ujzgWMZItE/mqdefault.jpg', NULL, '5ujzgWMZItE&feature=youtu.be', '0:9:7', 6, 'yt:quality=high,yt:crop=16:9,gsviec,cloudfront,khoa hoc amazon web service,aws', 389, 0, 1492508076, NULL, 1492508081, 'active', 'N', 0, 'N', 'N', 'N'),
(76, 16, 'video', 'youtube', 'Cấu hình Wordpress với Cloudfront và S3', NULL, 'cau-hinh-wordpress-voi-cloudfront-va-s3', 'Với những website có đặc thù thường xuyên phải lưu trữ & chia sẻ hình ảnh hay video trong các bài viết cũng như có các nhóm bạn đọc phân bổ rộng rãi ở các vùng miền khác nhau trên thế giới thì website sẽ chạy khá là chậm nhưng nếu dùng S3 và CloudFront để giải quyết vấn đề đó thì khá là ngon\r\n\r\n\r\n\r\nhttps://github.com/humanmade/S3-Uploads\r\nhttps://gsviec.com/blog/tang-toc-wordpress-voi-cloudfront', NULL, 'https://i.ytimg.com/vi/aVBoDznhZfg/mqdefault.jpg', NULL, 'aVBoDznhZfg', '0:12:12', 2, 'yt:quality=high,yt:crop=16:9,gsviec', 238, 0, 1492518428, NULL, 1492518433, 'active', 'N', 0, 'N', 'N', 'N'),
(77, 16, 'video', 'youtube', 'Cấu hình domain của bạn thây thế cho domain AWS CloudFront', NULL, 'cau-hinh-domain-cua-ban-thay-the-cho-domain-aws-cloudfront', 'Như mình đã nói ở video trước thì việc dùng domain mặc định của Cloufront là không sao cả nhưng nếu bạn muốn thây đổi nó vì vài lý do như nhìn chuyên nghiệp hơn, tốt cho SEO...\r\n\r\n### Bài toán:\r\n\r\nGiả sử mình có domain của Cloudfront https://s3-us-west-2.amazonaws.com/lackky.shop/ giờ mình muốn chuyển nó thành http://cdn.gsviec.com trong đó gsviec là tên miền của tôi và tôi có quyền quản trị nó\r\n\r\n### Giải quyết vấn đề\r\n\r\nBạn vào phần cấu hình của một CloudFront sau đó chọn edit sẽ có mục cho bạn thêm vào, sau đó vào phần quản trị DNS cập nhật cho nó tuỳ thuộc vào nhà câp cấp mà nó phần giải CNAME nhanh hay chậm và chờ Cloudfront deploy nữa. Để hiểu rõ hơn bạn hãy xem video bên trên\r\n', NULL, 'https://i.ytimg.com/vi/NrG7vh-mL6Q/mqdefault.jpg', NULL, 'NrG7vh-mL6Q&feature=youtu.be', '0:5:6', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,cloudfront', 2, 0, 1492672656, NULL, 1492672900, 'private', 'N', 0, 'N', 'N', 'N'),
(78, 16, 'video', 'youtube', 'Cấu hình domain của bạn thây thế cho domain AWS CloudFront', NULL, 'cau-hinh-domain-cua-ban-thay-the-cho-domain-aws-cloudfront', 'Như mình đã nói ở video trước thì việc dùng domain mặc định của Cloufront là không sao cả nhưng nếu bạn muốn thây đổi nó vì vài lý do như nhìn chuyên nghiệp hơn, tốt cho SEO...\r\n\r\n### Bài toán:\r\n\r\nGiả sử mình có domain của Cloudfront https://s3-us-west-2.amazonaws.com/lackky.shop/ giờ mình muốn chuyển nó thành http://cdn.gsviec.com trong đó gsviec là tên miền của tôi và tôi có quyền quản trị nó\r\n\r\n### Giải quyết vấn đề\r\n\r\nBạn vào phần cấu hình của một CloudFront sau đó chọn edit sẽ có mục cho bạn thêm vào, sau đó vào phần quản trị DNS cập nhật cho nó tuỳ thuộc vào nhà câp cấp mà nó phần giải CNAME nhanh hay chậm và chờ Cloudfront deploy nữa\r\n\r\nĐể hiểu rõ hơn bạn hãy xem video bên trên\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/NrG7vh-mL6Q/mqdefault.jpg', NULL, 'NrG7vh-mL6Q&feature=youtu.be', '0:5:6', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,cloudfront', 283, 0, 1492672697, NULL, 1492672706, 'active', 'N', 0, 'N', 'N', 'N'),
(79, 16, 'video', 'youtube', 'Giới thiệu chứng chỉ số Amazon', NULL, 'gioi-thieu-chung-chi-so-amazon', 'Chứng chỉ số SSL (còn gọi là chứng thư số SSL) có vai trò rất quan trọng trong các giao dịch trực tuyến như: đặt hàng, thanh toán, trao đổi thông tin,... đặc biệt là trong các lĩnh vực thương mại điện tử, sàn giao dịch vàng và chứng khoán, cổng thanh toán, ví điện tử, ngân hàng điện tử, chính phủ điện tử. Khi được sử dụng, mọi dữ liệu trao đổi giữa người dùng và website sẽ được mã hóa (ở phía người gửi) và giải mã (ở phía người nhận) bởi cơ chế SSL mạnh mẽ nhất hiện nay.\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/_pSDABE5Wys/mqdefault.jpg', NULL, '_pSDABE5Wys&feature=youtu.be', '0:3:5', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 293, 0, 1492672846, NULL, 1492672850, 'active', 'N', 0, 'N', 'N', 'N'),
(80, 16, 'video', 'youtube', 'Cấu CNAME của bạn hay domain sử dụng chứng chỉ số của AWS', NULL, 'cau-cname-cua-ban-hay-domain-su-dung-chung-chi-so-cua-aws', 'Trong video trước tôi đã hướng dẫn bạn sử dụng domain của bạn thây vì dùng domain mặc định của Amazon CloudFront nhưng nó có một vấn đề đó là cái Domain của bạn chưa có hỗ trợ https, Vì vậy trong video này tôi sẽ hướng dẫn bạn làm chuyện đó\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/ZF_HyZ-PbR8/mqdefault.jpg', NULL, 'ZF_HyZ-PbR8&feature=em-upload_owner', '0:3:48', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,ssl,chung chi so amazon,cloudfront,cname', 252, 0, 1492672968, NULL, 1492672974, 'active', 'N', 0, 'N', 'N', 'N'),
(81, 16, 'video', 'youtube', 'Khắc phục lỗi timeout Vagrant', NULL, 'khac-phuc-loi-timeout-vagrant', 'Nếu bạn nào đã dùng Vagant dev thì có thể gặp trường hợp là khi chạy lệnh vagrant add \"ten-box\", ví dụ vagrant add phalconphp/xenial64Thì sau khi chạy vài phút bạn sẽ gặp lỗi timeout vì tập tin này quá lớn. \r\n\r\n```\r\nAn error occurred while downloading the remote file. The error\r\nmessage, if any, is reproduced below. Please fix this error and try\r\nagain.\r\n\r\nSSL read: error:00000000:lib(0):func(0):reason(0), errno 54\r\n\r\n```\r\nThì trong video này tôi sẽ hướng dẫn cho bạn cách khắc phục chuyện đó. Nếu chưa biết Vagrant là gì thì có thể xem bài viết [Cách sử dụng vagrant(https://gsviec.com/blog/gioi-thieu-vagrant)]\r\n\r\nTập tin meta.json trong video ở trên:\r\n\r\n```\r\n{\r\n    \"name\": \"phalconphp/xenial64\",\r\n    \"versions\": [{\r\n        \"version\": \"1.1.4\",\r\n        \"providers\": [{\r\n            \"name\": \"virtualbox\",\r\n            \"url\": \"file:///Users/phanbook/Downloads/5e8a0513-5ba9-4da3-b178-e5cc16cd3c70\"\r\n        }]\r\n    }]\r\n}\r\n```', NULL, 'https://i.ytimg.com/vi/wpCTizk1AtY/mqdefault.jpg', NULL, 'wpCTizk1AtY', '0:3:48', 6, 'yt:quality=high,yt:crop=16:9,gsviec,vagrant,timepout', 426, 0, 1493178215, NULL, 1493178370, 'active', 'N', 0, 'N', 'N', 'N'),
(82, 16, 'video', 'youtube', 'Cài đặt Phalcon', NULL, 'cai-at-phalcon', 'Phalcon nó là extension PHP do đó bạn có thể cài đặt dễ dàng trên Window hay LInux nhưg trong video này tôi sẽ hướng dẫn bạn cách cài đặt thông qua Docker\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/zCXhMJJ9Djo/mqdefault.jpg', NULL, 'zCXhMJJ9Djo', '0:2:46', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban,khoa hoc phalcon', 630, 0, 1493384305, NULL, 1493384312, 'active', 'N', 0, 'N', 'N', 'N'),
(83, 16, 'video', 'youtube', 'Cài đặt Phalcon Dev Tools', NULL, 'cai-at-phalcon-dev-tools', 'Chúng ta có khá là nhiều cách cài đặt Phalcon Dev Tools, trước tiên bạn cần vào trang hướng dẫn nó tại đây https://github.com/phalcon/phalcon-devtools\r\n\r\nCách sử dụng bạn có thể tham khảo đường dẫn này https://docs.phalconphp.com/en/latest/reference/tools.html\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/U_nX4ZHw9mg/mqdefault.jpg', NULL, 'U_nX4ZHw9mg', '0:2:10', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban,phalcondev tool', 624, 0, 1493384347, NULL, 1493384353, 'active', 'N', 0, 'N', 'N', 'N'),
(84, 16, 'video', 'youtube', 'Tạo khung sường ứng dụng Phalcon PHP', NULL, 'tao-khung-suong-ung-dung-phalcon-php', 'Không giống như các FW PHP khác khi bạn cài đặt Phalcon nó chỉ là một extendion do đó bạn cần phải tự tạo các khung sườn cho dự án riêng của bạn, do đó bạn có thể tuỳ biến dễ dàng đây cũng chính là một trong điểm mạnh của Phalcon PHP nhưng cũng chính là điểm yếu của nó, nếu bạn nào theo trường phái chấp nhận các quy định của người phát triển FW đó, chẳn hạn như Laravel hay ruby on rails bạn chỉ lấy cái mẫu Sekeleton của họ thôi, chứ còn tuỳ biến lại thì nát bét hết.\r\n\r\nVí dụ bạn thử tuỳ biến Laravel thành modular structure thử xem, thì mấy cái lệnh artisan của nó banh chành luôn, nhưng không thể phủ nhận nếu bạn dùng những tuỳ chọn mặc định từ Laravel thì dự án bạn code cực nhanh.\r\n\r\nhttps://github.com/phalcon/mvc\r\n\r\nKhi bạn tự tay thiết kế một cái Sekeleton thì bạn sẽ hiểu được những gì vận hành của dự án bạn\r\n\r\nphalcon project phalcon-canban  --enable-webtools', NULL, 'https://i.ytimg.com/vi/YJrCSvMEeQI/mqdefault.jpg', NULL, 'YJrCSvMEeQI', '0:2:9', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban', 721, 0, 1493384717, NULL, 1493384766, 'active', 'N', 0, 'N', 'N', 'N'),
(85, 16, 'video', 'youtube', 'Chọn IDE phù hợp để phát triển ứng dụng Phalcon PHP', NULL, 'chon-ide-phu-hop-e-phat-trien-ung-dung-phalcon-php', 'Như bạn biết là để viết code PhalconPHP thì ta có thể dùng notepad để viết cũng được nhưng không ai làm thế cả, vì vậy tôi sẽ đưa cho bạn những lời khuyên chọn IDE hay Editor hợp lý khi bắt đầu học Phalcon\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/AvlKfNyGVeU/mqdefault.jpg', NULL, 'AvlKfNyGVeU', '0:2:0', 6, 'yt:quality=high,yt:crop=16:9,gsviec,ide,phalconphp,phalcon ide', 245, 0, 1493384809, NULL, 1493385244, 'active', 'N', 0, 'N', 'N', 'N'),
(86, 16, 'video', 'youtube', 'Giới thiệu class Config của Phalcon PHP', NULL, 'gioi-thieu-class-config-cua-phalcon-php', 'Phalcon cung cấp cho ta khá là nhiều cách đọc tập cấu hình thông qua định dạng tập tin như php, yaml, json, ini bạn có thể xem chi tiết tại đây https://docs.phalconphp.com/en/latest/reference/config.html\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/lYxyikoUNQU/mqdefault.jpg', NULL, 'lYxyikoUNQU', '0:6:7', 9, 'yt:quality=high,yt:crop=16:9,gsviec,config,phalcon can ban', 526, 0, 1493384836, NULL, 1493384842, 'active', 'N', 0, 'N', 'N', 'N'),
(87, 16, 'video', 'youtube', 'Giới thiệu khóa học Phalcon PHP', NULL, 'gioi-thieu-khoa-hoc-phalcon-php', 'Trong hơn 4 năm qua tôi đã nghiên cứu và làm việc trên Phalcon Framework để xây dựng ứng dụng online theo yêu cầu của khách hàng. Trong quá trình xây và phát triển dựng dự án cho khách hàng, chúng tôi đã nhận thấy những ưu điểm vượt trội của Phalcon framework so với các PHP framework\r\n\r\nVì vậy tôi quyết định mở khóa học Phalcon này để chia sẽ những hiểu biết của tôi cho các bạn trẻ muốn học Phalco Để xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/Ac1V0LuNJ-E/mqdefault.jpg', NULL, 'Ac1V0LuNJ-E', '0:2:3', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon,khoa hoc phalcon', 8781, 0, 1493384304, NULL, 1493384304, 'active', 'N', 0, 'N', 'N', 'N'),
(88, 16, 'video', 'youtube', 'Giới thiệu tính năng Loader', NULL, 'gioi-thieu-tinh-nang-loader', 'Documents: https://docs.phalconphp.com/en/latest/reference/loader.html\r\n\r\nAPI: https://docs.phalconphp.com/en/latest/api/Phalcon_Loader.html\r\n\r\nKhi bạn làm việc với PHP thì bạn có sử dụng các hàm include, required để nạp file vào nhưng cái này chỉ hợp lý với dự án bạn cái vài tập tin thôi, chứ dự án lớn mà có hàng trăm file thì bạn dùng hàm include là không ổn, do đó Phalcon nó cung cấp cho bạn một thư viện Phalcon\\Loader\r\n\r\nLazy loading là kỹ thuật rất quan trọng trong lập trình hướng đối tượng. Vì nhờ có nó ta có thể tiết kiệm được rất nhiều thao tác gọi nạp file khi sử dụng. Bản thân lazy loading sử dụng magic method (các phương thức đặc biệt trong PHP) để triệu gọi dữ liệu. Cụ thể là phương thức __autoload(). https://en.wikipedia.org/wiki/Lazy_initialization\r\n\r\n- Registering Namespaces\r\n\r\n- Registering Directories\r\n\r\n- Registering Classes\r\n\r\n- Registering Files\r\n\r\nhttps://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/pFIeaRBbwk0/mqdefault.jpg', NULL, 'pFIeaRBbwk0', '0:13:51', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon,phalcon can ban', 3081, 0, 1493521947, NULL, 1493521956, 'active', 'N', 0, 'N', 'N', 'N'),
(89, 16, 'video', 'youtube', 'Giới thiệu routing trong Phalcon', NULL, 'gioi-thieu-routing-trong-phalcon', 'Route dịch ra có nghĩa là tuyến đường, nghe chẳng có tý gì liên quan đến lập trình nhưng ta có thể hiểu rằng route nó nằm vai trò chỉ đường cho yêu cầu (request) đi đến đâu. \r\n\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/ZbNV_NtWKSo/mqdefault.jpg', NULL, 'ZbNV_NtWKSo', '0:2:39', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,phalconphp,router', 3139, 0, 1493522382, NULL, 1493522387, 'active', 'N', 0, 'N', 'N', 'N'),
(90, 16, 'video', 'youtube', 'Giới thiệu các service trong Phalcon', NULL, 'gioi-thieu-cac-service-trong-phalcon', 'Mặc định Phalcon nó sẽ tải các service(Component) mặc định như request, cookie, router, etc, xem thêm tại đây https://github.com/phalcon/cphalcon/blob/master/phalcon/di/factorydefault.zep\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-can-ban', NULL, 'https://i.ytimg.com/vi/Rywi1w0DHPw/mqdefault.jpg', NULL, 'Rywi1w0DHPw', '0:8:54', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon,phalcon can ban,component phalcon', 7324, 0, 1493522417, NULL, 1493522424, 'active', 'N', 0, 'N', 'N', 'N'),
