(92, 16, 'video', 'youtube', 'Giới thiệu Controller trong Phalcon', NULL, 'gioi-thieu-controller-trong-phalcon', 'Trong Phalcon PHP để tạo một controller thì quy tắc đặt tên tập tin nó như sau:\r\n\r\n\"Tên tập tin\" + Controller.php\r\n\r\nLúc này đường dẫn của bạn sẽ như sau: http://ten-web-site/controller/ nó sẽ lấy action index làm mặc định khi bạn gõ đường dẫn trên\r\n\r\nTất nhiên bạn vẫn có thể không dùng hậu tố Controller nhưng như thế thì bạn phải cấu hình lại core của bạn rất vất quả, với lại mình khuyên không nên vì như thế mất đi tính chất naming trong lập trình.\r\n\r\nCòn để tạo một Action trong Controller bạn theo quy tắc sau:\r\n\r\n\r\n\"Tên Action\" + Action\r\n\r\nLúc này đường dẫn của bạn sẽ như sau: http://ten-web-site/controller/action\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/Z3gjFqXcTZQ/mqdefault.jpg', NULL, 'Z3gjFqXcTZQ', '0:4:35', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,phalconphp,controller trong phalcon', 1874, 0, 1493698165, NULL, 1493698182, 'active', 'N', 0, 'N', 'N', 'N'),
(93, 16, 'video', 'youtube', 'Request và Respone trong Controller Phalcon', NULL, 'request-va-respone-trong-controller-phalcon', 'Trong phần này bạn sẽ hiểu các thành phần cơ bản của request và response của Phalcon\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/IRAvK5TB_MU/mqdefault.jpg', NULL, 'IRAvK5TB_MU', '0:8:14', 9, 'yt:quality=high,yt:crop=16:9,gsviec,request va response,phalcon can ban,phalconphp', 1573, 0, 1493699681, NULL, 1493699687, 'active', 'N', 0, 'N', 'N', 'N'),
(94, 16, 'video', 'youtube', 'Giới thiệu View trong Phalcon', NULL, 'gioi-thieu-view-trong-phalcon', 'Khi bạn tạo controller với tên là LoginController.php thì view mặc định của nó là login tất nhiên bạn vẫn có thể thây đổi điều này.\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/33pqq_1EEy4/mqdefault.jpg', NULL, '33pqq_1EEy4', '0:4:58', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,phalconphp,phalcon view', 3374, 0, 1493703520, NULL, 1493703565, 'active', 'N', 0, 'N', 'N', 'N'),
(95, 16, 'video', 'youtube', 'GIới thiệu Volt template engine trong Phalcon', NULL, 'gioi-thieu-volt-template-engine-trong-phalcon', 'Hầu hết khi bạn làm việc với view trong Phalcon PHP thì bạn sẽ làm trên volt, do đó nắm rõ Volt giúp cho bạn code nhanh hơn khi làm việc các dự án Phalcon PHP', NULL, 'https://i.ytimg.com/vi/CA11rVU_Sw0/mqdefault.jpg', NULL, 'CA11rVU_Sw0', '0:10:13', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,khoa hoc phalcon can ban,volt', 2777, 0, 1493803834, NULL, 1493803919, 'active', 'N', 0, 'N', 'N', 'N'),
(96, 16, 'video', 'youtube', 'Kế thừa template trong volt Phalcon', NULL, 'ke-thua-template-trong-volt-phalcon', 'Khi bạn làm việc với các dự án thực tế thì bạn cần phải cấu hình lại cấu trúc thư mục view trong Phalcon PHP để việc tái sử dụng code cũng như dễ maintainer sau này thì video này dành cho bạn', NULL, 'https://i.ytimg.com/vi/cYiiS_HG3YE/mqdefault.jpg', NULL, 'cYiiS_HG3YE', '0:9:1', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,volt,phalconphp', 2577, 0, 1493803970, NULL, 1493804085, 'active', 'N', 0, 'N', 'N', 'N'),
