(99, 16, 'video', 'youtube', 'Giới thiệu thành phần Flash và FlashSession trong Phalcon', NULL, 'gioi-thieu-thanh-phan-flash-va-flashsession-trong-phalcon', 'Nếu bạn nào muốn xuất hiện câu thông báo tin nhắn khi đăng nhập hoặc báo lỗi thì hãy dùng component Flashing Messages mà Phalcon nó cung cấp, trong video này bạn sẽ hiểu được cách thức làm việc nó.\r\n\r\nĐể hiểu rõ hơn bạn có thể xem nó trên dây https://docs.phalconphp.com/en/3.0.2/reference/flash.html\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/41vVXUFGyJI/mqdefault.jpg', NULL, '41vVXUFGyJI', '0:6:55', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalconphp,phalcon can ban,gioi thieu flash trong phalcon,flash,flashsession', 5884, 0, 1493869567, NULL, 1493869573, 'active', 'N', 0, 'N', 'N', 'N'),
