(109, 16, 'video', 'youtube', 'Cách sử dụng RAW SQL trong Phalcon', NULL, 'cach-su-dung-raw-sql-trong-phalcon', 'Đôi lúc bạn cần phải sử dụng SQL thuần ví một số lý do chẳn hạn như bạn cần hiệu năng của câu truy vấn đó, hoặc câu SQL đó có phức tạp không thể thực hiện đuọc trong ORM\r\n\r\nhttps://docs.phalconphp.com/en/3.0.1/reference/phql.html#using-raw-sql\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-102', NULL, 'https://i.ytimg.com/vi/GApBJvq1ft4/mqdefault.jpg', NULL, 'GApBJvq1ft4', '0:9:18', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,phalcon pdo,raw sql', 1996, 0, 1496310588, NULL, 1496310595, 'active', 'N', 0, 'N', 'N', 'N'),
(110, 16, 'video', 'youtube', 'Giới thiệu PHQL trong Phalcon', NULL, 'gioi-thieu-phql-trong-phalcon', 'Cá nhân tôi thì không thích dùng thằng này lắm, nhưng nếu bạn thấy thoải mái với nó thì dùng thôi diểm khác biệt PHQL so với RAWSQL là nó chèn vào model thây vì table trong database\r\nhttps://docs.phalconphp.com/en/latest/reference/phql.html', NULL, 'https://i.ytimg.com/vi/ZxDorwkULSg/mqdefault.jpg', NULL, 'ZxDorwkULSg', '0:8:17', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,phql', 1450, 0, 1496311151, NULL, 1496311164, 'active', 'N', 0, 'N', 'N', 'N'),
(111, 16, 'video', 'youtube', 'Đăng ký người dùng trong Phalcon', NULL, 'ang-ky-nguoi-dung-trong-phalcon', 'Đăng ký người dùng là không thể thiếu trong các ứng dụng web do đó trong video hôm nay tôi sẽ hướng dẫn các bạn cách tạo người dùng trong Phalcon\r\n\r\nBạn sẽ học được cách kiểm tra dữ liệu hợp lệ từ người dùng hay không, cũng như kiểm tra user đó có tồn tại trong database hay không!\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/sfHMco-Ex4o/mqdefault.jpg', NULL, 'sfHMco-Ex4o', '0:7:49', 9, 'yt:quality=high,yt:crop=16:9,gsviec,phalcon can ban,register trong Phalcon', 1080, 0, 1496630398, NULL, 1496630404, 'active', 'N', 0, 'N', 'N', 'N'),
