(114, 16, 'video', 'youtube', 'Cách dùng vi căn bản', NULL, 'cach-dung-vi-can-ban', 'Có rất nhiều trình soạn thảo trong Linux nhưng trình soạn thảo vi là trình soạn thảo được nhiều người dùng Linux sử dụng nhất vì là nó chiếm ít tài nguyên mặc khác nó được thiết lập như một trình soạn thảo mặc định trên các bản phân phối của Linux/Unix.\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/2gLYvyEnG1I/mqdefault.jpg', NULL, '2gLYvyEnG1I&feature=youtu.be', '0:4:11', 6, 'yt:quality=high,yt:crop=16:9,gsviec,vi,linux,vps', 732, 0, 1499230903, NULL, 1499230909, 'active', 'N', 0, 'N', 'N', 'N'),
(115, 16, 'video', 'youtube', 'Giới thiệu khóa học lập trình mobile Ionic', NULL, 'gioi-thieu-khoa-hoc-lap-trinh-mobile-ionic', 'Trong khóa này mình sẽ hướng dẫn các bạn tạo, viết và chạy ứng dụng trực tiếp trên di động một cách nhanh và đơn giản với IonicFramework – một framework xây dựng dựa trên AngularJS và Cordova.', NULL, 'https://i.ytimg.com/vi/FWYfDMyeQs4/mqdefault.jpg', NULL, 'FWYfDMyeQs4&feature=youtu.be', '0:3:16', 6, 'yt:quality=high,yt:crop=16:9,gsviec,ionic,laptrinh mobile', 831, 0, 1499231121, NULL, 1499231167, 'active', 'N', 0, 'N', 'N', 'N'),
(116, 16, 'video', 'youtube', 'Giới thiệu các bản phân phổi Linux', NULL, 'gioi-thieu-cac-ban-phan-phoi-linux', 'Phiên bản Linux đầu tiên do Linus Torvalds viết vào năm 1991, lúc ông còn là một sinh viên của Đại học Helsinki tại Phần Lan. Ông làm việc một cách hăng say trong vòng 3 năm liên tục và cho ra đời phiên bản Linux 1.0 vào năm 1994. Bộ phận chủ yếu này được phát triển và tung ra trên thị trường dưới bản quyền GNU General Public License. Do đó mà bất cứ ai cũng có thể tải và xem mã nguồn của Linux.\r\n\r\n \r\nXem thêm https://sites.google.com/site/mithuatonline88/home/truyen-cuoi/cn-tt/can-ban-ve-cac-he-dieu-hanh-linux-va-nhung-ban-cap-nhat-moi-nhat\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/eZu-leQQTwg/mqdefault.jpg', NULL, 'eZu-leQQTwg&feature=youtu.be', '0:1:51', 6, 'yt:quality=high,yt:crop=16:9,gsviec,linux,centos,ubuntu', 1111, 0, 1500346368, NULL, 1500346377, 'active', 'N', 0, 'N', 'N', 'N'),
(117, 16, 'video', 'youtube', 'Giới thiệu Linode và DO', NULL, 'gioi-thieu-linode-va-do', 'Để có được môi trường phát triển Linux bạn có thể cài đặt nó trên máy bạn nhưng tôi khuyên bạn nên dùng Cloud Sử dụng một cloud DO https://goo.gl/MXZZbD hoặc Linode https://goo.gl/kAoNFa\r\n\r\nVì đằng nào bạn cũng sẽ triển khai dự án thực tế trên đó\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/lNiIsxsBxqY/mqdefault.jpg', NULL, 'lNiIsxsBxqY&feature=youtu.be', '0:4:50', 6, 'yt:quality=high,yt:crop=16:9,gsviec,linode,do', 1081, 0, 1500346397, NULL, 1500346406, 'active', 'N', 0, 'N', 'N', 'N'),
(118, 16, 'video', 'youtube', 'Kết nối tới máy chủ qua SSH với chương trình Putty', NULL, 'ket-noi-toi-may-chu-qua-ssh-voi-chuong-trinh-putty', 'PuTTY là một phần mềm cho phép kết nối đến máy chủ (VPS/Server Linux) qua giao thức SSH để thực hiện các điều khiển bằng dòng lệnh (command line). Để sử dụng PuTTY khách hàng cần download phần mềm này về máy tính. Khách  hàng có thể tải từ trang chủ bản cài đặt hoặc bản dùng ngay. http://www.putty.org/\r\n\r\nhoac https://chrome.google.com/webstore/detail/termius-ssh-client/fjcdjmmkgnkgihjnlbgcdamkadlkbmam', NULL, 'https://i.ytimg.com/vi/2i65DmEtpJE/mqdefault.jpg', NULL, '2i65DmEtpJE&feature=youtu.be', '0:2:22', 6, 'yt:quality=high,yt:crop=16:9,gsviec,putty,ssh', 711, 0, 1500346444, NULL, 1500346450, 'active', 'N', 0, 'N', 'N', 'N'),
(119, 16, 'video', 'youtube', 'Chỉnh lại terminal VPS cho dễ nhìn', NULL, 'chinh-lai-terminal-vps-cho-de-nhin', 'Mặc định khi login vào Centos khung giao diện nó chỉ có màu trắng và đen rất khó nhìn do đó bạn nên cài đặt thêm bash shell tại đây  \r\nhttps://github.com/duythien/sexy-bash-prompt\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/VTU90HIGWmA/mqdefault.jpg', NULL, 'VTU90HIGWmA&feature=youtu.be', '0:2:35', 6, 'yt:quality=high,yt:crop=16:9,gsviec,bash shell,chinh terminal', 845, 0, 1500346476, NULL, 1500346480, 'active', 'N', 0, 'N', 'N', 'N'),
(120, 16, 'video', 'youtube', 'Thao tác thư mục và tập tin', NULL, 'thao-tac-thu-muc-va-tap-tin', 'Để xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/CHjvCra7hJQ/mqdefault.jpg', NULL, 'CHjvCra7hJQ&feature=youtu.be', '0:7:2', 6, 'yt:quality=high,yt:crop=16:9,gsviec', 820, 0, 1500346507, NULL, 1500346514, 'active', 'N', 0, 'N', 'N', 'N'),
(121, 16, 'video', 'youtube', 'Giới thiệu LEMP và cài đặt nginx', NULL, 'gioi-thieu-lemp-va-cai-at-nginx', 'LEMP là một nhóm các phần mềm mã nguồn mở được cài trên máy chủ Webserver, được viết tắt từ Linux, NGINX (Engine x), MySQL, và PHP. LEMP tương tự như LAMP chỉ khác web server trên nền tảng Nginx thay vì Apache. Đặc điểm Nginx là một web server mã nguồn mở hoạt động nhanh và  ít tài nguyên hệ thống hơn Apache. Đối với các hệ thống nhẹ sự khác nhau giữa Apache và Nginx là không đáng kể, tuy nhiên ở các hệ thống nặng thì Nginx thể hiện sự vượt trội hơn rất nhiều so với Apache.\r\n\r\nhttps://gsviec.com/blog/huong-dan-cai-dat-lemp-tren-centos', NULL, 'https://i.ytimg.com/vi/D36ZkaKA3rk/mqdefault.jpg', NULL, 'D36ZkaKA3rk&feature=youtu.be', '0:7:4', 6, 'yt:quality=high,yt:crop=16:9,gsviec,nginx,lemp,lamp', 835, 0, 1500346536, NULL, 1500346541, 'active', 'N', 0, 'N', 'N', 'N'),
