(123, 16, 'video', 'youtube', 'Cài đặt MySQL trên centos 7', NULL, 'cai-at-mysql-tren-centos-7', 'Trong video này tôi sẽ hướng dẫn các bạn cài đặt MySQL \r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://youtu.be/z_dSkb2Xlvk', NULL, 'https://i.ytimg.com/vi/H9eOctTPD_k/mqdefault.jpg', NULL, 'H9eOctTPD_k&feature=youtu.be', '0:5:22', 6, 'yt:quality=high,yt:crop=16:9,gsviec,mysql,mariadb', 811, 0, 1500346619, NULL, 1500346632, 'active', 'N', 0, 'N', 'N', 'N'),
