(125, 16, 'video', 'youtube', 'Cài đặt Wordpress', NULL, 'cai-at-wordpress', 'Ok sau khi cài đặt xong LEMP thì bạn muốn kiểm tra xem nó có làm việc hay không thì cài đặt Wordpress là một trong những cách đó\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-vps-can-ban', NULL, 'https://i.ytimg.com/vi/6iZoOkGD5Hs/mqdefault.jpg', NULL, '6iZoOkGD5Hs&feature=youtu.be', '0:9:19', 6, 'yt:quality=high,yt:crop=16:9,gsviec,lemp,wordpress', 400, 0, 1500351425, NULL, 1500351430, 'active', 'N', 0, 'N', 'N', 'N'),
(126, 16, 'video', 'youtube', 'Hướng dẫn sử dụng Queue trong Phalcon phần 1', NULL, 'huong-dan-su-dung-queue-trong-phalcon-phan-1', 'Hôm nay trong video này tôi sẽ hướng dẫn bạn sử dụng một thư viện php-resque tương tác queue, như các bạn biết có khá nhiều dịch vụ như RabbitMQ, Beanstalk, etc, tại sao tôi lại dùng nó thứ nhất vì thư viện này viết bằng PHP, sau đó nó lại kết hợp với Redis để lưu trữ các thông tin của jobs queue đó, và tất nhiên nó khá là dễ sử dụng\r\n\r\n### Bạn cần cài đặt các thành phần sau:\r\n\r\n- Redis server https://redis.io/\r\n\r\n- Thư viện PHP cho Redis tại https://github.com/phpredis/phpredis\r\n\r\n- Thư viện Workers and Queueing mail\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-102', NULL, 'https://i.ytimg.com/vi/pDMhbUKleM4/mqdefault.jpg', NULL, 'pDMhbUKleM4&feature=youtu.be', '0:3:45', 9, 'yt:quality=high,yt:crop=16:9,gsviec,queue,phalcon can ban', 750, 0, 1503114487, NULL, 1503114499, 'active', 'N', 0, 'N', 'N', 'N'),
