(129, 16, 'video', 'youtube', 'Giới thiệu AWS EC2 căn bản', NULL, 'gioi-thieu-aws-ec2-can-ban', 'Trong video này tôi sẽ giới thiệu các bạn tổng quan giao diện về trình quản lý EC2 cũng như cách khởi tạo nó, bạn có thể xem slide của tôi tại đây https://speakerdeck.com/duythien/about-amazon-ec2\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/YlfwF9gCdOQ/mqdefault.jpg', NULL, 'YlfwF9gCdOQ', '0:20:29', 6, 'yt:quality=high,yt:crop=16:9,gsviec,ec2,khoa hoc aws can ban', 650, 0, 1504952483, NULL, 1504952494, 'active', 'N', 0, 'N', 'N', 'N'),
(130, 16, 'video', 'youtube', 'Căn bản về Eslastic IP trong EC2', NULL, 'can-ban-ve-eslastic-ip-trong-ec2', 'Mặc định khi bạn stop một con Ec2 bạn sẽ không phải trả tiền cho con đó nữa, nhưng như thế bạn sẽ bị mất địa chỉ Public IP, vậy làm thế nào để không mất địa chỉ Public Ip này thì thằng Elastic IP này sẽ giúp bạn\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/DBtEvgUj2Us/mqdefault.jpg', NULL, 'DBtEvgUj2Us&feature=youtu.be', '0:6:54', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws', 269, 0, 1504958453, NULL, 1504958460, 'active', 'N', 0, 'N', 'N', 'N'),
(131, 16, 'video', 'youtube', 'Tắt tính năng delete một bucket của  AWS S3', NULL, 'tat-tinh-nang-delete-mot-bucket-cua-aws-s3', 'Tuần vừa rồi tôi bị hạcker tấn công bị mất dữ liệu database, nhưng rất may tôi có bản backup nên không sao cả, tôi chợt nghĩ nếu hacker có key access s3 thì thật nguy hiểm, vì vậy trong video này tôi sẽ hướng dẫn các bạn các tắt tính năng delete đó. \r\n\r\nĐoạn code trong video này bạn có thể tải về trên này https://github.com/gsviec/aws001/blob/master/s3-no-delete-bucket.json\r\n\r\nNgoài ra bạn cũng có thể bật tính năng version trong S3 để backup cách này bạn có thể xem video đây\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban', NULL, 'https://i.ytimg.com/vi/0-kwlVGWVNY/mqdefault.jpg', NULL, '0-kwlVGWVNY&feature=youtu.be', '0:8:32', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,s3,ec2,iam', 157, 0, 1504961863, NULL, 1504961872, 'active', 'N', 0, 'N', 'N', 'N'),
(132, 16, 'video', 'youtube', 'Giới thiệu version trong AWS S3', NULL, 'gioi-thieu-version-trong-aws-s3', 'Nếu bạn muốn tracking hay đề phòng hacker xoá hình ảnh trong bucket, làm thế nào để phục hồi lại nếu bạn bật version lên thì dữ liệu bạn sẽ không bị mất\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/lKQ48icpQtE/mqdefault.jpg', NULL, 'lKQ48icpQtE&feature=youtu.be', '0:6:24', 6, 'yt:quality=high,yt:crop=16:9,gsviec,version s3,aws s3', 486, 0, 1504962658, NULL, 1504962667, 'active', 'N', 0, 'N', 'N', 'N'),
(133, 16, 'video', 'youtube', 'Debug volt trong Phalcon với Xdebug', NULL, 'debug-volt-trong-phalcon-voi-xdebug', 'Như bạn biết thì mặt định các IDE nó không hỗ trợ đặt breakpoin trong các template như twig, hay volt vậy làm thế nào để đặt breakpoint cho nó, trong video này tôi sẽ hướng dẫn các bạn\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/XmUAXyGknE4/mqdefault.jpg', NULL, 'XmUAXyGknE4&feature=youtu.be', '0:1:46', 9, 'yt:quality=high,yt:crop=16:9,gsviec,volt,phalcon,phpstorme', 471, 0, 1505643229, NULL, 1505643238, 'active', 'N', 0, 'N', 'N', 'N'),
