(136, 16, 'video', 'youtube', 'Giới thiệu Amazon Relation Service phần 1', NULL, 'gioi-thieu-amazon-relation-service-phan-1', 'Dịch vụ Amazon Relation Database một trong những dịch vụ phổ biến nhất mà cụ thể là MySQL, nếu bạn muốn tìm hiểu nó thì video này dành cho bạn\r\n\r\nBạn cũng có thể xem slide của tôi tại đây https://speakerdeck.com/duythien/introdution-amazon-relation-service\r\n\r\nĐể xem nhiều video về AWS  bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban-002', NULL, 'https://i.ytimg.com/vi/PFeRsoqZLDQ/mqdefault.jpg', NULL, 'PFeRsoqZLDQ&feature=youtu.be', '0:10:22', 6, 'yt:quality=high,yt:crop=16:9,gsviec,mysql,aws,aws-database', 257, 0, 1509161065, NULL, 1509161093, 'active', 'N', 0, 'N', 'N', 'N'),
(137, 16, 'video', 'youtube', 'Giới thiệu Amazon Relation Service phần 2', NULL, 'gioi-thieu-amazon-relation-service-phan-2', 'Trong video trước tôi đã hướng dẫn các bạn cách tạo một MySQL trên AWS là gì rôi, trong video này tôi sẽ hướng dẫn các bạn cách tạo một MySQL replication\r\n\r\nBạn cũng có thể xem slide của tôi tại đây https://speakerdeck.com/duythien/introdution-amazon-relation-service\r\n\r\nBài viết giải thích MySQL repication https://www.toptal.com/mysql/mysql-master-slave-replication-tutorial\r\n\r\nĐể xem nhiều video về AWS bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-amazon-web-service-can-ban-002', NULL, 'https://i.ytimg.com/vi/_03PN3bfQ0U/mqdefault.jpg', NULL, '_03PN3bfQ0U&feature=youtu.be', '0:6:8', 6, 'yt:quality=high,yt:crop=16:9,gsviec,replication,aws', 405, 0, 1509161449, NULL, 1509161453, 'active', 'N', 0, 'N', 'N', 'N');
INSERT INTO `posts` (`id`, `usersId`, `type`, `techOrder`, `title`, `link`, `slug`, `content`, `excerpt`, `thumbnail`, `filename`, `videoFilename`, `duration`, `categoryId`, `tags`, `numberViews`, `numberReply`, `createdAt`, `modifiedAt`, `editedAt`, `status`, `locked`, `deleted`, `acceptedAnswer`, `monetize`, `sticked`) VALUES
(138, 16, 'video', 'youtube', 'Giới thiệu Amazon Route 53', NULL, 'gioi-thieu-amazon-route-53', 'Trong video này chúng tôi sẽ hướng dẫn bạn cách cấu hình Route 53 trên godady.com cũng như giới thiệu sơ qua trang quản trị Route 53\r\n\r\nAmazon Route 53 là một dịch vụ dùng để quản lý DNS, do đó nếu bạn chưa hiểu DNS là gì có thể xem bài viết này https://gsviec.com/blog/dns-la-gi. Thông thường khi bạn mua một tên miền(domain) từ nhà cung cấp dịch vụ họ sẽ cung cấp cho bạn dịch vụ DNS luôn, ví dụ godady là\r\n\r\n```\r\nns01.domaincontrol.COM\r\nns02.domaincontrol.COM\r\n\r\n```\r\n\r\nNgoài ra các nhà cung cấp dịch vụ như linode họ cung sẽ cung cấp miễn phí cho các bạn, bạn có thể kiểm tra gsviec.com dùng nhà cung cấp nào thông qua lệnh sau:\r\n\r\n\r\n```\r\ndig gsviec.com any\r\n\r\ngsviec.com.       21599   IN  NS  ns5.linode.com.\r\ngsviec.com.      21599   IN  NS  ns1.linode.com.\r\ngsviec.com.      21599   IN  NS  ns3.linode.com.\r\ngsviec.com.      21599   IN  NS  ns2.linode.com.\r\ngsviec.com.      21599   IN  NS  ns4.linode.com.\r\n\r\n```\r\n\r\nNhư bạn thấy các nhà cung cấp khác đã cho bạn miễn phí, nhưng Route53 không có miễn phí, vậy chúng ta có cần nó không? câu trả lời của chúng tôi là **có và không** phụ thuộc vào dự án và kiến trúc hệ thống của server bạn\r\n\r\nNếu bạn là cá nhân hay tổ chức vừa và nhỏ và không dùng dịch vụ của AWS [Route 53](https://aws.amazon.com/route53/)  thì chúng tôi khuyên các bạn không nên dùng nó. Nhưng nếu kiến trúc hệ thống bạn sử dụng nền tảng Route 53 thì chắc chắn bạn nên dùng, dưới đây chúng tôi sẽ đưa lý do tại sao bạn nên dùng.\r\n\r\n\r\n### Tại sao nên dùng Route 53\r\n\r\n- Chi phí cực kỳ rẻ: $0.400 per million queries – first 1 Billion queries / month\r\n\r\n- Cung cấp healthy để kiểm tra service của bạn còn hoạt động hay không rất là tiện lợi cho việc cấu hình load balancer(Healthy and Weighted Routing Policy)\r\n\r\n- Cung cấp các policy(chính sách) điều hướng lượng trafic đến các service của bạn\r\n\r\n- Sự phản hồi cực kỳ nhanh chóng(Latency based Routing Policy)\r\n\r\n- Phân giải tên miền trong mạng nội bộ (Private DNS)\r\n\r\n- Bạn có thể mua domain từ Route 53(Domain Registration)\r\n\r\n- Cung cấp các tính năng vùng miền trên thế giới để điều hướng người dùng tương ứng( Geolocation Routing Policy)\r\n\r\n\r\n', NULL, 'https://i.ytimg.com/vi/Qym6kAEfNnM/mqdefault.jpg', NULL, 'Qym6kAEfNnM&feature=youtu.be', '0:9:22', 6, 'yt:quality=high,yt:crop=16:9,aws,route53,dns', 711, 0, 1509875069, NULL, 1509875153, 'active', 'N', 0, 'N', 'N', 'N'),
(139, 16, 'video', 'youtube', 'Cách cấu hình Xdebug  trong PhalconPHP', NULL, 'cach-cau-hinh-xdebug-trong-phalconphp', 'Như bạn biết thì việc cài đặt Xdebug trong Docker cũng không khác là mấy so với việc cài đặt thông thường trên máy của bạn, nhưng nếu bạn gặp khó khăn thì video này dành cho bạn\r\n\r\nFile cấu hình Docker và Xdebug bạn có thể tải tại đây https://github.com/gsviec/phalcon-canban\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com/playlist/khoa-hoc-phalcon-102', NULL, 'https://i.ytimg.com/vi/8qI3g0wHFrQ/mqdefault.jpg', NULL, '8qI3g0wHFrQ', '0:7:11', 120, 'yt:quality=high,yt:crop=16:9,gsviec,docker,phalcon,xdebug,phpstorm', 125, 0, 1511672882, NULL, 1511672899, 'active', 'N', 0, 'N', 'N', 'N'),
(140, 16, 'video', 'youtube', 'Giới thiệu AMI trong EC2', NULL, 'gioi-thieu-ami-trong-ec2', 'Nếu bạn muốn tiết kiệm thời gian việc tạo đi tạo lại các dịch vụ như LEMP, LAMP, vâng vâng hoặc muốn dùng Elastic load balancing của AWS thì phần AMI là không thể bỏ qua, trong video này chúng tôi sẽ hướng dẫn các bạn làm cách tạo AMI\r\n\r\nHãy tưởng tượng đơn giản nó giống như một bản ghost vậy .  Chúng ta có thể dễ dàng tạo ra các EC2 Instance với config giống y hệt nhau từ AMI của primary Instance . Đây sẽ là cách để thực hiện back up trong những trường hợp mà ta muốn thay đổi config hay để tạo EC2 Instance sử dụng cho ELB  . Một điểm thú vị nữa là ta có thể thực hiện mua bán các AMI này . Nếu bạn cho rằng AMI của bạn là đặc biệt , hãy đưa chúng lên AWS Market Place , biết đâu lại có bất ngờ cho thu nhập của bạn \r\n\r\nNguồn từ http://awslagi.com/huong-dan-tao-ami-amazon-machine-image/\r\n\r\nCode cho video này:\r\n\r\n```\r\n<?php\r\n$this_instance_id = file_get_contents(\'http://169.254.169.254/latest/meta-data/instance-id\');\r\nif(!empty($this_instance_id))\r\n   echo (string)($this_instance_id);\r\nelse\r\n   echo \"Sorry, instance id unknown\";\r\n```', NULL, 'https://i.ytimg.com/vi/_qf3-OnhIP4/mqdefault.jpg', NULL, '_qf3-OnhIP4', '0:7:7', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,ec2,ami', 236, 0, 1511673473, NULL, 1511676577, 'active', 'N', 0, 'N', 'N', 'N'),
(141, 16, 'video', 'youtube', 'Cách tạo Elastich Load Balancing trong AWS', NULL, 'cach-tao-elastich-load-balancing-trong-aws', 'Như bạn biết thì Elastic Load Balancing là một trong những dịch vụ quan trọng và được dùng khá là thường xuyên nếu như các bạn có định dùng dịch vụ của AWS, vì vậy trong video hôm nay chúng tôi sẽ hướng dẫn bạn cách tạo Elastic Load Balancing\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/AePO-3lUhTY/mqdefault.jpg', NULL, 'AePO-3lUhTY', '0:11:43', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,elb,elastic-load-balancer', 315, 0, 1511674784, NULL, 1511674790, 'active', 'N', 0, 'N', 'N', 'N'),
(142, 16, 'video', 'youtube', 'Tự động mở rộng EC2(auto scale ec2)', NULL, 'tu-ong-mo-rong-ec2-auto-scale-ec2', 'Trong video trước tôi đã hướng dẫn các bạn cách tạo ELB là gì rồi, nhưng nó vẫn chưa có tính năng scale tự động, trong video này tôi sẽ hướng dẫn các bạn làm chuyện đó\r\n\r\nNếu bạn đưa ra chính sách mở rộng (Scaling Policies) sau đó Auto Scaling có thể khởi chạy hoặc xoá bỏ instance theo như nhu cầu ứng dụng của bạn tăng thêm hoặc giảm bớt. => Giả sử: web của bạn full tải CPU, RAM tối đa được 1k user truy cập cùng 1 lúc. Bạn sẽ dùng policy để khi CPU, RAM full thì hệ thống sẽ tự động add thêm instance mới vào để giảm tải cho server, ELB có trách nhiệm chia đều request cho các instance, khi đó CPU, RAM ko  full nữa.\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/ye3_FW3AjWY/mqdefault.jpg', NULL, 'ye3_FW3AjWY&feature=youtu.be', '0:11:27', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,ec2,auto-scale-ec2,elb', 311, 0, 1511676122, NULL, 1511676776, 'active', 'N', 0, 'N', 'N', 'N'),
(143, 16, 'video', 'youtube', 'Hello world trong Docker', NULL, 'hello-world-trong-docker', 'Như mọi công nghệ và ngôn ngữ lập trình thì ứng dụng Hello World luôn luôn được dùng để thử ngôn ngữ đó hay công nghệ đó\n\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/KZPqdqAOBUE/mqdefault.jpg', NULL, 'KZPqdqAOBUE', '0:3:0', 120, 'php,yt:quality=high,yt:crop=16:9,gsviec', 296, 0, 1513147134, NULL, 1513147134, 'active', 'N', 0, 'N', 'N', 'N'),
(144, 16, 'video', 'youtube', 'Cách dùng căn bản ElastichSearch trên AWS', NULL, 'cach-dung-can-ban-elastichsearch-tren-aws', 'Trong video trước chúng tôi đã hướng dẫn các bạn cách setup nó trên AWS như thế nào rồi, trong video này chúng tôi sẽ demo một ví dụ nhõ về cách sử dụng nó, mà cụ thể là phân tích log hệ thộng và nginx\r\n\r\nBạn cũng có thể xem demo server link này https://search-lackky-ojizzlhc54j33o3cmrgb274qsi.ap-southeast-1.es.amazonaws.com/_plugin/kibana/\r\n\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/aSJIDwAwBI4/mqdefault.jpg', NULL, 'aSJIDwAwBI4&feature=youtu.be', '0:7:32', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,aws elastichsearch service,kibana', 295, 0, 1514259224, NULL, 1514259234, 'active', 'N', 0, 'N', 'N', 'N'),
(145, 16, 'video', 'youtube', 'Tạo một con ElastichSearch trên AWS', NULL, 'tao-mot-con-elastichsearch-tren-aws', 'Trong video này chúng tôi hướng dẫn các bạn cách tạo một con elastich trên AWS\r\n\r\nNếu bạn nào chưa biết Elastich là gì có thể truy cập thông qua website này để hiểu https://www.elastic.co/\r\n\r\nBạn có thể xem kết quả tại link này https://search-lackky-ojizzlhc54j33o3cmrgb274qsi.ap-southeast-1.es.amazonaws.com/\r\nĐể xem nhiều video bạn có thể truy cập vào website: https://gsviec.com', NULL, 'https://i.ytimg.com/vi/tWRXBeKiH24/mqdefault.jpg', NULL, 'tWRXBeKiH24&feature=youtu.be', '0:6:29', 6, 'yt:quality=high,yt:crop=16:9,gsviec,aws,elastich,kibana', 328, 0, 1514259500, NULL, 1514259505, 'active', 'N', 0, 'N', 'N', 'N');
